{"department_text": "Automotive & Industrial", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_ind_saf/186-5151927-0681541?ie=UTF8&node=318135011", "text": "Safety", "description_title": "Safety Supplies", "keyword_count": {"safety supplies": 3, "supplies": 4, "safety": 16}, "description_wc": 308, "description_text": "Safety supplies come in a variety of forms, including safety signs, personal protective equipment, and a wide array of other safety equipment. Safety supplies are used to mark an area, or to help protect persons from potentially hazardous conditions. Lock out tag out, sometimes referred to as lockout tagout (LO/TO), are safety procedures that use safety devices to help keep areas safe. Lock out tag out devices use color, warning labels or tags, and a physical barrier to temporarily prohibit machine operation or power activation, and reduce accidents, during maintenance or repair. Safety signs, or warning signs such as \u201cExit\u201d, \u201cDanger\u201d, or \u201cCaution\u201d, are used to display messaging and inform people of important circumstances. Personal protective equipment is anything from reflective chest coverings to hardhats, or Geiger counters & radiation detectors, used to detect the presence of ionizing radiation, to emergency response, first aid supplies, and eye wash units. Fire alarms and fire extinguishers are also used in safety. Additional safety products include: gloves, safety glasses, ear protection, hardhats, coveralls, fire-resistant clothing, rainwater & chemical splash apparel, and lab coats. Hazardous storage cabinets, and hazardous storage cans are safety equipment. Glove options include; cleanroom gloves, controlled environment gloves, cryogenic gloves, cut-resistant gloves, disposable gloves, and work gloves. Flags are a type of safety sign that come in a variety of colors, shapes, dimensions, and may have a magnetic, quick disconnect, or threaded hex base type. Flags can also come with reflective markings and lighting. Floor markers come in various types of adhesive tape, colors, markings (such as stripes, arrows, or words), and widths that can be used to mark an area. Safety mirrors are used as personal protective equipment. Safety supplies are used in construction sites, work sites, high-traffic areas, and in home applications. Safety equipment can meet various safety standards.", "parent_text": "Automotive & Industrial", "keyword_density": {"safety supplies": "2.0", "supplies": "1.3", "safety": "5.3"}, "department_id": 15},
{"level": 1, "url": "http://www.amazon.com/dp/B00BTI6HBS/ref=sd_allcat_kdppnwn/186-5151927-0681541", "text": "Kindle Paperwhite 3G", "description_wc": 0, "parent_text": "Kindle Books & E-readers", "department_text": "Kindle Books & E-readers", "department_id": 3},
{"department_text": "Automotive & Industrial", "level": 1, "url": "http://www.amazon.com/b/ref=sd_allcat_ind_jan/186-5151927-0681541?ie=UTF8&node=317971011", "text": "Janitorial", "description_title": "Janitorial Supplies", "keyword_count": {"supplies": 7, "janitorial supplies": 4, "janitorial": 7}, "description_wc": 243, "description_text": "Janitorial supplies are used to clean and maintain work and home environments. Commercial cleaning supplies and supplies used by homeowners include general cleaning supplies, equipment & fixtures, personal care items, and waste receptacles & liners. Janitorial supply products commonly include business essentials that are routinely re-stocked, such as all-purpose cleaners, bathroom cleaners, disinfectants, and disposal wipes. Janitor-housekeeping carts can have various material types, shelving, handle types, capacity, dimensions, colors, and the ability to hold trash bags or other waste-collection containers. Janitorial supply products include personal care items, such as facial tissues, hand soap, paper towels, sanitizers, and toilet paper. Janitorial supplies also include equipment & fixtures, such as baby-changing tables, carpet sweepers, floor polishers, hand dryers, paper towel dispensers, soap & lotion dispensers, toilet bowls, toilet paper dispensers, toilet seat dispensers, and urinals. Personal care items, such as facial tissues, hand soap, paper towels, sanitizers, and toilet paper are commonly used janitorial supplies. Janitorial supply products also include maintenance products, such as waste receptacles & liners. A trash can, recycling container, rollout trash can, and commercial trash bin are commonly used Rubbermaid Commercial Products. These Rubbermaid Commercial Products come in a variety of capacities, shapes, dimensions, materials, and colors. Smoking receptacles include an array of products used to contain cigarette waste. Smoking receptacles come in many capacities, types, dimensions, and material types. Janitorial supplies, used by professionals and in private applications, are necessary to maintain and clean work areas and provide personal care.", "parent_text": "Automotive & Industrial", "keyword_density": {"supplies": "2.9", "janitorial supplies": "3.3", "janitorial": "2.9"}, "department_id": 15},
