{"department_text": "Automotive & Industrial", "level": 1, "url": "http://www.amazon.com/Lab-Scientific-Supplies/b/ref=sd_allcat_ind_lab/186-5151927-0681541?ie=UTF8&node=317970011", "text": "Lab & Scientific", "description_title": "About Lab Equipment", "keyword_count": {"lab equipment": 4, "equipment": 7, "lab": 17}, "description_wc": 269, "description_text": "Lab Equipment includes a wide variety of laboratory supplies such as meters, microscopes, and purification systems that are used to facilitate scientific and educational processes. Researchers, educators, and hobbyists use lab equipment such as lab furnaces, microscopes, shakers, hot plates, and stirrers to assist in testing, measuring, inspecting, and data gathering. Microscopes, used to enhance the resolution of an object or image, are commonly used lab equipment, found in many biology, chemistry, and learning labs. Other laboratory equipment, such as furnaces, are used for heating applications that require a range of high temperatures. They heat to high temperatures evenly and maintain consistent temperatures, while providing an environment free of undesirable contaminants and moisture. Autoclaves are also commonly used laboratory supplies that assist in sterilization applications. Additional lab supplies include desiccators, which are seal-able enclosures used to protect contents from atmospheric moisture. A centrifuge is used to spin fluids of different densities to separate various parts, commonly blood and DNA samples. Laboratory equipment, such as lab baths and accessories, are used to assist with common lab operations. An electrophoresis apparatus is designed to run multiple groups of student samples at the same time. Lab supplies can be made from a wide variety of material types, selected for their application abilities such as temperature, water, or chemical resistance. Some lab supplies are designed to meet specific health, safety, and environmental standards. Lab equipment commonly operates with electrical or battery-powered sources, and may come with a warranty. Laboratory equipment is widely used in education, lab research, biology, metallurgy, engineering, chemistry, manufacturing, and in the medical, forensic science, and veterinary industries.", "parent_text": "Automotive & Industrial", "keyword_density": {"lab equipment": "3.0", "equipment": "2.6", "lab": "6.3"}, "department_id": 15},
{"department_text": "Automotive & Industrial", "level": 1, "url": "http://www.amazon.com/Motorcycle-ATV-Automotive/b/ref=sd_allcat_matv/186-5151927-0681541?ie=UTF8&node=346333011", "text": "Motorcycle & Powersports", "description_title": "More about Motorcycle and Powersports Parts", "keyword_count": {"powersports parts": 5, "parts": 16, "motorcycle": 14}, "description_wc": 224, "description_text": "Amazon.com has a great selection of motorcycle parts and powersports parts. Find motorcycle parts for your bike\u2019s motor , body , braking system , or drive train . Discover replacement or performance exhaust systems , and replacement or upgraded lighting in our motorcycle parts selection. You can also find a wide variety of ATV and powersports parts, including replacement or performance items. Motorcycle helmets and protective gear are popular items. Flip-up, full face, open face and off-road motorcycle helmets are featured from the industry\u2019s top names. You can even find replacement shields for motorcycle helmets. Choose from a large selection of jackets, pants, gloves and jerseys for yourself and a friend, and choose many other new motorcycle parts and accessories to match your new gear. Need gift ideas or looking for bargains? There\u2019s a motorcycle parts gift guide and an outlet for motorcycle parts on the site. Battery chargers and helmets are very popular motorcycle parts gifts. We also host a wide selection of ATV and powersports parts that are easy to gift. Shop for motorcycle parts based on customer review, price, brand, or shipping option. You can also search by the best selling motorcycle parts and powersports parts. It\u2019s easy to find the right motorcycle parts when you shop for motorcycle parts and powersports parts on Amazon.com.", "parent_text": "Automotive & Industrial", "keyword_density": {"powersports parts": "4.6", "parts": "7.3", "motorcycle": "6.4"}, "department_id": 15},
