{"department_text": "Automotive & Industrial", "nr_products": 320457, "level": 1, "url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/186-5151927-0681541?ie=UTF8&node=15706941", "text": "Automotive Tools & Equipment", "description_title": "More about Automotive Tools", "keyword_count": {"automotive": 7, "tools": 11, "automotive tools": 5}, "description_wc": 168, "description_text": "To take care of your vehicle, you are going to need a wide number of automotive tools. Fortunately, Amazon.com Automotive houses a wide selection of automotive tools that you can use to fix and enhance your car, truck, ATV, or RV. Our selection goes above and beyond our diagnostic and scanner tools . Our automotive tools allow users to truly understand problems that are occurring with their vehicle, and then fix them. The automotive tool selection includes body repair tools , brake repair tools , drive train tools , garage and shop tools , impact wrenches , and so much more. Our automotive tools provide auto owners the ability to work independently on their car, allowing them to save money. These automotive tools act as the perfect complimentary purchase to any other performance or replacement part purchase that you make on our store. Since these tools are shipped quickly, you can save yourself a trip down to the store and get started working on your vehicles right away.", "parent_text": "Automotive & Industrial", "keyword_density": {"automotive": "4.3", "tools": "6.8", "automotive tools": "6.2"}, "department_id": 15},
{"department_text": "Automotive & Industrial", "level": 1, "url": "http://www.amazon.com/automotive-auto-truck-replacements-parts/b/ref=sd_allcat_apa/186-5151927-0681541?ie=UTF8&node=15684181", "text": "Automotive Parts & Accessories", "description_title": "More about Auto Parts and Accessories", "keyword_count": {"auto": 17, "parts and accessories": 3, "parts": 18, "auto parts": 12}, "description_wc": 252, "description_text": "The world of auto parts includes everything from performance parts to car care to tools and equipment for cars, trucks and even RVs. Amazon.com Automotive Parts and Accessories store presents this huge world of automotive products an organized online store with a number of refinements, so you can find the auto parts you need. For example, the Green Automotive section contains earth-friendly auto parts. Replacement Parts showcases auto parts to keep your car or truck in top shape. Interior auto parts , exterior auto parts and car care auto parts let you update and care for your ride. Our auto parts even include everything from wheel and tire care products to new rims and wheels. There are even gift ideas for the enthusiast. Amazon.com Automotive also has a helpful Part Finder tool that allows customers to find and filter products that fit their vehicle. You can browse through products with this tool, or even use it to filter down specific array of products. Browse the site and discover auto parts that make winter less stressful, parts and accessories for your RV, tools that help diagnose what\u2019s wrong, as well as parts to fix what ails your vehicle. You can even shop for auto parts by trusted name brands or find auto parts for specific vehicle brands like Chevrolet , Ford , or Ferrari . Even better, Amazon\u2019s Automotive Parts and Accessories store lets you shop for auto parts in one location from the comfort of your home or garage.", "parent_text": "Automotive & Industrial", "keyword_density": {"auto": "6.9", "parts and accessories": "