{"department_text": "Automotive & Industrial", "nr_products": "135113", "level": 0, "url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "text": "Test, Measure & Inspect", "description_title": "Test, Measure, and Inspect", "parent_url": "http://www.amazon.com/industrial-scientific-supplies/b/ref=sd_allcat_ind_sup/186-5151927-0681541?ie=UTF8&node=16310091", "keyword_count": {"test": 6, "test measure and inspect": 2, "inspect": 3, "measure": 14}, "description_wc": 344, "description_text": "Test, Measure, and Inspect equipment includes a wide array of instrumentation, tools, equipment and accessories used for a variety of applications. Calipers are used for dimensional measurement to measure diameter and depth, or replicate a measurement from one space to another. Vernier calipers, digital, and dial calipers are common caliper types. A pH meter , also called a pH tester, is a water quality and instrumentation device that is used for pH testing. Balances, a type of lab instrument, are a measuring instrument used to determine the mass of an object. Mechanical balances use a lever and slide to indicate measurement. Conventional balances display results digitally, but are less precise than analytical balances. A triple beam balance is a commonly used type of mechanical balance that has three beams that carry adjustable slider weights for precise measurement. Scales such as Ohaus scales, are typically used to weigh the mass of an object, may be portable, have an LCD reading screen, are often made of stainless steel, and can be powered by batteries or electricity. Scales have the ability to weigh in various capacities, such as 100g or 300g. Tools and equipment that are used as common measuring tools in dimensional measurement include micrometers. Outside micrometers are precision measuring instruments that use a calibrated screw to measure the length, width, or outside diameter of an object. Inside micrometers measure interior distances on a workpiece, such as a span between two edges, or the diameter of a circle or hole. Micrometers have inch or metric measurement. Flow meters, also called flow sensors, are electrical components used to measure flow rate of a substance, such as air or water. Flow meters can measure linear, nonlinear, mass, or volumetric flow rate. Oscilloscopes are electrical testing equipment used to inspect and analyze electrical signals. A surface roughness tester is used to measure surface roughness in shop, metalworking, manufacturing, and quality control (QC) applications. A headband magnifier provides hands-free magnification and viewing. Test, Measure, and Inspect instrumentation is commonly used in science, engineering, machining, industrial, health, and educational applications.", "parent_text": "Industrial Supplies", "keyword_density": {"test": "1.7", "test measure and inspect": "2.3", "inspect": "0.9", "measure": "4.1"}, "department_id": 15},
