{"department_text": "Automotive & Industrial", "nr_products": "14816", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_15?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A4989323011&bbn=256409011&ie=UTF8&qid=1394470598&rnid=256409011", "text": "Water Quality & Instrumentation", "description_title": "Water Quality & Instrumentation", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "keyword_count": {"water": 11, "water quality": 4}, "description_wc": 330, "description_text": "Because water quality and water composition have a direct impact on the environment, food and beverage production, agriculture, aquaculture, manufacturing, and healthcare, water quality testing plays an important role in each of these areas. Water quality testing encompasses a wide variety of applications and instruments, from measuring hard water and the alcohol content in beer and wine, to testing cosmetics and petroleum products. Multiparameter meters use sensors to measure a number of different parameters of water quality. For any particular meter, these parameters might include pH level (acidity or alkalinity of a substance), conductivity (the amount of salts or other compounds present that affect water conductivity), dissolved oxygen (DO, the amount of oxygen in a liquid), temperature, total dissolved solids (TDS, anything present in water other than the pure water molecule and suspended solids), salinity, resistivity, or oxidation reduction potential (ORP). Applications for multiparameter meters include water testing, pharmaceuticals, agriculture, wine-making, water-treatment plants, and aquaculture. Devices with a benchtop body are often used for indoor laboratory use or in a manufacturing setting; handheld, portable devices are typically used for fieldwork. A flowmeter , sometimes called a flow gauge or flow indicator, measures the flow rate of a fluid in a confined space and is used for a variety of applications, including measuring flow rates though rivers and channels, measuring fuel movement through a fuel injector, and diagnosing leakage or blockage in valves and pipes. They can be permanently installed inline or placed for temporary measurements, and can be read manually or have a digital display. Hydrometers are used to measures specific gravity and density of liquids. They are made of glass or plastic and are placed in a sample of the fluid to be measured. Measurements are then read directly off the meter shaft. Because there are several different scales used for different industries, hydrometers are manufactured for measuring specific types of solutions, including syrups, sugar and sucrose, petroleum products, alcohol, and soil.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"water": "3.4", "water quality": "2.5"}, "department_id": 15},
