{"department_text": "Automotive & Industrial", "nr_products": "3228", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13400481_nr_n_6?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A328182011%2Cn%3A8106310011%2Cn%3A13400481%2Cn%3A553012&bbn=13400481&ie=UTF8&qid=1394470600&rnid=13400481", "text": "Welders", "description_title": "Welders from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_37?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A13400481&bbn=15706941&ie=UTF8&qid=1394470593&rnid=15706941", "keyword_count": {"amazoncom": 3, "welders": 10}, "description_wc": 310, "description_text": "Professionals and hobbyists alike can find the welders they need for fabrication, repairs and more at Amazon.com. With our selection of accessories and other welding equipment, you can also make sure you have all the extras you need to make excellent welds and stay safe. We have a wide variety of welders to choose from. Electrical welders are reliable, and ideal for a number of applications. Arc welders can be used at home or at the jobsite for metal fabrication, so whether you\u2019re welding artistic sculptures or structures for construction purposes, our welders can give you the service you need. Some come built with robust, wheeled steel cases, so you can move them around to your worksite with utmost ease. Welders with long, flexible nozzles give you the ability to move around and get full control over your angles and positions. To ensure that you get welders from the same quality brands that you\u2019ve trusted before, we offer Campbell Hausfeld, Maxus, Longevity, and other popular models. If you want to ensure that you\u2019re getting a model that other customers have bought and loved, try filtering your search by average customer rating and read the great reviews to get a better understanding before you buy. After you choose your welder, you can also find a great selection of welding accessories and equipment on Amazon.com as well. Safety is the most important issue before you do any fabrication work, and we carry a collection of safety goggles and masks especially made for welders. We also offer stainless steel brushes to clean off your workstations, welding tip cleaners, electrode kits, and flint strikers. If you\u2019re looking for welders and other equipment on a budget, try filtering your search by price to see some of the most affordable options we carry. You can find reliable and trusted welders at Amazon.com.", "parent_text": "Welding Tools", "keyword_density": {"amazoncom": "1.0", "welders": "3.2"}, "department_id": 15},
