{"nr_products": "202", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_n_0?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A559938%2Cn%3A2324199011&bbn=559938&ie=UTF8&qid=1394470599&rnid=559938", "text": "Aviation GPS", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_3248684011_nr_n_5?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A3248684011%2Cn%3A559938&bbn=3248684011&ie=UTF8&qid=1394470593&rnid=3248684011", "parent_text": "Vehicle GPS", "department_text": "Automotive & Industrial", "department_id": 15},
