{"department_text": "Automotive & Industrial", "nr_products": "20672", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_9?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A5006545011&bbn=256409011&ie=UTF8&qid=1394470598&rnid=256409011", "text": "Pressure & Temperature", "description_title": "Pressure & Temperature", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "keyword_count": {"pressure": 11, "temperature": 9}, "description_wc": 118, "description_text": "Equipment for measuring and monitoring mechanical pressure and temperature include pressure gauges , pressure sensors , pressure transmitters , temperature controllers , temperature sensors , and thermometers . A pressure gauge measures the pressure of a gas or liquid inside a container. A pressure sensor and pressure transmitter monitor changes in mechanical pressure and convert the pressure measurement to an electronic signal. A temperature controller manages the temperature of a system based on input from a temperature sensor, which measures temperature. A thermometer contains a sensor and scale to report the temperature reading. Pressure and temperature measurement devices are used for industrial applications such as petrochemical processing, hydraulic installations, process control, heavy equipment, and HVAC installations, among others.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"pressure": "9.8", "temperature": "8.0"}, "department_id": 15},
{"nr_products": "20360", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_5?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A4989315011&bbn=256409011&ie=UTF8&qid=1394470598&rnid=256409011", "text": "Inspection & Analysis", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "parent_text": "Test, Measure & Inspect", "department_text": "Automotive & Industrial", "department_id": 15},
{"department_text": "Automotive & Industrial", "nr_products": "416", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_6?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A393278011&bbn=256409011&ie=UTF8&qid=1394470598&rnid=256409011", "text": "Light Measurement", "description_title": "Light Measurement", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "keyword_count": {"light": 17, "measurement": 4}, "description_wc": 360, "description_text": "A photometer and a light meter are instruments for measuring luminance, the intensity of light. While a photometer is sometimes called a light meter, there are distinctions between these devices. Whereas a photometer measures the intensity of light that passes through a solution, a light meter measures the amount of ambient or reflected light in a given environment. Both are available in portable, battery-powered models, and a photometer is also available in benchtop form. Test results are generally displayed on a digital readout. A photometer is used for water quality testing in industrial and scientific applications in the laboratory and in the field. A light meter is used for environmental testing of light pollution, determining proper lighting for photography, and checking conditions for plant growth. Photometers test a solution for specific substances or properties. They may be calibrated for a certain element, compound, or chemical such as ammonia, chlorine, phosphates, or surfactants; or for a certain property such as hardness, color, or pH. While some photometers test for a single parameter, others test for multiple parameters. Many photometers accommodate a cuvette for holding samples. Reagents are available for performing particular testing methods. A photometer is a simplified version of a spectrophotometer , which measures the amount of light of a specified wavelength that passes through a sample. Light meters usually consist of a handheld display unit and a light sensor probe. They measure light in lumens, showing measurements in either lux (1 lumen per square meter) or foot-candles (1 lumen per square foot). Some meters toggle between both units of measure. Measurement range, accuracy, resolution, and sampling rate vary from meter to meter. For example, a typical single-range light meter measures up to 2,000 foot candles (fc)/20,000 lux whereas a high-intensity light meter with multiple measurement ranges, such as the Extech EA33, may have a top range of 99,990 fc/999,900 lux. Among the features a light meter may have are storage and recall of readings, data logging, comparator function, averaging function, and measurement hold. Light meter reviews can be a source of information to help consumers select the best meter for an application.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"light": "4.7", "measurement": "1.1"}, "department_id": 15},
