{"nr_products": "172", "level": -1, "url": "http://www.amazon.com/s/ref=lp_3310284011_nr_n_2?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310284011%2Cn%3A3310291011&bbn=3310284011&ie=UTF8&qid=1394470598&rnid=3310284011", "text": "Drain Openers", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_317971011_nr_n_3?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A317971011%2Cn%3A3310284011&bbn=317971011&ie=UTF8&qid=1394470592&rnid=317971011", "parent_text": "Odor & Drain Maintainers", "department_text": "Automotive & Industrial", "department_id": 15},
{"department_text": "Automotive & Industrial", "nr_products": "22774", "level": -1, "url": "http://www.amazon.com/s/ref=lp_256409011_nr_n_2?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011%2Cn%3A4989299011&bbn=256409011&ie=UTF8&qid=1394470598&rnid=256409011", "text": "Dimensional Measurement", "description_title": "Dimensional Measurement", "parent_url": "http://www.amazon.com/s/ref=lp_16310091_nr_n_18?rh=n%3A16310091%2Cn%3A%2116310161%2Cn%3A256409011&bbn=16310161&ie=UTF8&qid=1394470592&rnid=16310161", "keyword_count": {"dimensional measurement": 2, "measurement": 8}, "description_wc": 364, "description_text": "Making dimensional measurements is a critical part of everyday operations in fields such as manufacturing, machining, metalworking, woodworking, engineering, drafting, automotive maintenance, medicine, and scientific research. Various measurement tools are available, from basic rulers for linear measurement to ultrasonic thickness gauges for nondestructive testing of material thickness. A ruler is a tool with an inch, metric, or both inch and metric scale for measuring distances and marking lines. A straight edge is used to draw or scribe straight lines and often does not have graduations. To set and measure angles through either 180 or 360 degrees, a protractor may be used. A caliper measures the inside and outside dimensions of an object as well as the depth of a hole, displaying measurements on a vernier scale, dial, or digital readout. Most calipers are either pivot-type with two legs that mark the points of measurement, or slide-type with a set of adjustable jaws. A micrometer measures either the external dimensions of an object or internal dimensions such as the diameter of a hole or the width of a groove. It has a screw mechanism for precise adjustment of the measuring faces. There are a variety of gauges for dimensional measurement. A chamfer gauge measures the largest diameter of a chamfer, or beveled edge, while a countersink gauge measures the largest diameter of a countersunk hole. A bore gauge , or hole gauge , measures the distance between the sides of a hole. Depth gauges measure the depth of a hole, slot, step, or recess. Height gauges are used to determine the height of an object. A radius gauge checks the radius of a groove, corner, or other rounded surface. Pin gauges are cylindrical plugs for measuring the diameter of machined holes and slots. Ring gauges are metal bands for go/no-go inspections and may serve as a master for other measurement tools. A snap gauge is used to make comparative measurements of the outside dimensions of objects. Thread gauges check the thread size and pitch diameter of threaded parts. A feeler gauge measures gaps between parts. Thickness gauges measure the thickness of materials. Many gauges incorporate a dial indicator that displays readings.", "parent_text": "Test, Measure & Inspect", "keyword_density": {"dimensional measurement": "1.1", "measurement": "2.2"}, "department_id": 15},
