{"department_text": "Automotive & Industrial", "nr_products": "872", "level": 0, "url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_32?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A155346011&bbn=15706941&ie=UTF8&qid=1394470593&rnid=15706941", "text": "Tire Air Compressors & Inflators", "description_title": "Air Compressor from Amazon.com", "parent_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/186-5151927-0681541?ie=UTF8&node=15706941", "keyword_count": {"air compressor": 6, "amazoncom": 1, "compressor": 9, "air": 10}, "description_wc": 292, "description_text": "One of the most useful and versatile tools that you will ever own is an air compressor. More than just a tire inflator, it can be used to power your spray gun, nail gun, power wrench, and so much more. When shopping for an air compressor or tire inflator, you will notice that there are two standard types of air compressors on the market: piston-type compressors and portable compressors. The most common is the portable compressor, although the piston type is usually found in a commercial-garage setting or in the home garage of someone who does a lot of automotive repairs. The piston-type air compressor or tire inflator has a tank that is used to store compressed air. The motor will shut off whenever the tank is full, and restart whenever the pressure inside the tank drops. The portable air compressor is small, compact, and perfect for use as a tire inflator. It doesn't have a storage tank, and runs continually to provide air for inflating tires, sports equipment, pool floats, and so forth, or for powering smaller spray guns and other small air tools. Choosing the right unit for your needs is important. If you will use it as a basic tire inflator, then you will be fine going with a portable unit that you can store in the trunk of your car and that probably plugs into the opening for your cigarette lighter. One thing to pay special attention to is the horsepower rating of the unit. This can range from 1.5 HP to 7 HP. The more horsepower the unit offers, the bigger the jobs it can handle. You can find a top-notch tire inflator or air compressor from trusted brands when shopping Amazon.com.", "parent_text": "Automotive Tools & Equipment", "keyword_density": {"air compressor": "4.1", "amazoncom": "0.3", "air": "3.4", "compressor": "3.1"}, "department_id": 15},
