{"department_text": "Automotive & Industrial", "nr_products": "2633", "level": 0, "url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_17?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A15708671&bbn=15706941&ie=UTF8&qid=1394470593&rnid=15706941", "text": "Impact Wrenches", "description_title": "Impact Wrenches from Amazon.com", "parent_url": "http://www.amazon.com/Tools-Equipment-Automotive/b/ref=sd_allcat_ate/186-5151927-0681541?ie=UTF8&node=15706941", "keyword_count": {"impact": 14, "impact wrenches": 6, "amazoncom": 2, "wrenches": 8}, "description_wc": 381, "description_text": "Automotive repair shops each have their own unique selection of tools, but almost all have one tool in common: the impact wrench. An impact wrench, which may also be called an air gun, air wrench, or torque gun, is a power tool that puts a high-torque output in the palm of your hand, without much work on your part. Rather than tightening a bolt by hand, which would not give you enough torque to ensure it was completely tight and safe, you can use an impact wrench to torque it and ensure it is tight. The wrenches have a socket wrench design, which is often used to repair automobiles and other heavy equipment. It can also be used in construction projects or product assembly when the products are large and heavy. Shopping online for impact wrenches puts the largest selection at your disposal. The first consideration to make when shopping for an impact wrench is the size you need. An impact wrench can have just about any standard socket-wrench size, with models as small as 1/4 inch all the way to over 3 inches. Choose the size that you would most commonly use. Next, shoppers need to consider the source of power for their wrenches. The most common power source for impact wrenches is compressed air. This provides lower torque capacity than their electric powered counterparts. Electric impact wrenches are commonly used in automotive-repair situations, and they can be 12-, 18-, or 24-volt DC powered. Cordless impact wrenches are also available. Finally, an industrial impact wrench may use a high-speed hydraulic motor. Almost any mechanic's shop you visit will have an impact wrench or two to use, and they are more likely to be electric-corded models or air-powered models. Finally, the amount of torque is an important consideration. This will vary depending on the power source and the size of the motor. Shoppers can choose between low- and high-torque impact wrenches when shopping at Amazon.com. As you consider your impact wrench needs, trust Amazon.com to provide the major brands, a wide range of styles, and many different sizes. Sort your choices by brand, or browse through the existing inventory of impact wrenches to find the exact model you need.", "parent_text": "Automotive Tools & Equipment", "keyword_density": {"impact": "3.7", "impact wrenches": "3.2", "amazoncom": "0.5", "wrenches": "2.1"}, "department_id": 15},
