{"department_text": "Automotive & Industrial", "nr_products": "405", "level": -1, "url": "http://www.amazon.com/s/ref=lp_15707701_nr_n_16?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A15707701%2Cn%3A15707971&bbn=15707701&ie=UTF8&qid=1394470623&rnid=15707701", "text": "Roller Seats & Creepers", "description_title": "Creepers from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_15706941_nr_n_14?rh=n%3A15684181%2Cn%3A%2115690151%2Cn%3A15706941%2Cn%3A15707701&bbn=15706941&ie=UTF8&qid=1394470593&rnid=15706941", "keyword_count": {"creepers": 6, "amazoncom": 2, "creepers from amazoncom": 1}, "description_wc": 311, "description_text": "It can be a lot of fun to work on the car at home. Oil changes, tune-ups, and other minor chores are the sort of thing you helped out with when you were a kid, and with the right creepers, you can be the one under the car's frame. Creepers come in a variety of configurations, depending on the sort of work for which you need them. Some creepers are simple stools, albeit designed to resist staining from the oil and other fluids you'll find in a garage. Other creepers let you lie almost flat on the floor and glide around under the car to get the job done. You will probably need both types of creeper because they play different roles in a well-organized garage. Creepers come in such a wide variety that it can be confusing. Looking for the right creeper online is a great way to survey your entire range of options quickly and easily. You'll also benefit from access to customer reviews about your purchase when the shopping is being done online. This takes a lot of the risk out of any purchase, and it's especially valuable when you're thinking about buying a creeper. Working from the right position on your back is crucial to getting work done on the car without injury. Lying prone on a cold slab of concrete isn't a good idea, and neither is making do with equipment you picked up secondhand, which might not meet your needs. Finding the right gear for your garage is a lot easier when you buy from Amazon.com. The old loving atmosphere you enjoyed as a kid working on your parents' car can be brought back with the right equipment. Getting your creepers from Amazon.com can be your first step to recreating the magic for your own kids today.", "parent_text": "Garage & Shop", "keyword_density": {"creepers": "1.9", "amazoncom": "0.6", "creepers from amazoncom": "1.0"}, "department_id": 15},
