{"department_text": "Sports & Outdoors", "nr_products": 100426, "level": 1, "url": "http://www.amazon.com/Golf-Sports-Outdoors/b/ref=sd_allcat_golf/186-5151927-0681541?ie=UTF8&node=3410851", "text": "Golf", "description_title": "Golf Equipment from Amazon.com", "keyword_count": {"golf": 11, "golf equipment from amazoncom": 2, "golf equipment": 5}, "description_wc": 328, "description_text": "Feeling a cool breeze against your face as you pull back and swing at a golf ball is a relaxing, almost meditative experience. Thanks to quality golf equipment from Amazon.com, you can enjoy the rich landscape of a grassy course and maybe even hit a few eagles. Or you can leave the wildlife alone and try harder to get in on the green. Golf clubs are number one on our list of golf equipment essentials, so we offer a wide variety of clubs for your needs. If you\u2019re looking for the right iron, wood or putter, you\u2019re in luck; you can select specific drivers to make short work of your quest for the perfect club. If you\u2019re not looking for individual clubs, you can also choose from our complete sets to get everything you need to go out to the driving range. When you don\u2019t have time to drive to the range, we can help you set up a variety of training options so you can practice while you\u2019re at home. Take a break after work with our practice putting greens and try to sink a few balls before dinner. Our golf nets can be hooked up in your back yard or garage so you can swing away and keep the birds and neighbors\u2019 windows safe. Among our collection of golf equipment, you\u2019ll find a variety of swing trainers so you can build up your core muscles and hone your tempo and lag. When you finally have time to visit the course but the weather isn\u2019t behaving, we have the solution for you. Specially made golf umbrellas, golf hats, and other golf equipment can make you comfortable in any weather. Our polo and other golf shirts are breezy enough that hot, summer days won\u2019t be a problem. With quality training and golf equipment from Amazon.com, the days of evicting birds from their nests will be a thing of the past.", "parent_text": "Sports & Outdoors", "keyword_density": {"golf": "3.4", "golf equipment": "3.0", "golf equipment from amazoncom": "2.4"}, "department_id": 14},
