{"department_text": "Sports & Outdoors", "nr_products": 13271057, "level": 1, "url": "http://www.amazon.com/Sports-Collectibles/b/ref=sd_allcat_sprt_cllct/186-5151927-0681541?ie=UTF8&node=3250697011", "text": "Sports Collectibles", "description_title": "Sports Collectibles at Amazon.com", "keyword_count": {"sports collectibles": 8, "sports": 16}, "description_wc": 291, "description_text": "Welcome to our new Sports Collectibles store featuring sports memorabilia and sports collectibles from past, current and future stars from all major sport leagues and events including: Major League Baseball (MLB), National Football League (NFL), National Basketball Association (NBA), National Hockey League (NHL), Major League Soccer (MLS), NCAA, and Olympics. If you are looking to build your collection of sports collectibles and sports memorabilia or want to find a unique gift for an avid collector that will surprise them, our new store has the unique selection of sports memorabilia and sports collectibles that you are looking for. We focus on authentic sports collectibles and sports memorabilia, such as autographs and game-used jerseys authenticated by Ace Authentic, Frameworth, Highland Mint, Icon Sports Memorabilia, James Spence Authentication, MeiGray Group, MLB Players Alumni Association, Mounted Memories, NFL Players Inc., Panini Authentic, PSA/DNA, Steiner Sports, Topps, Tristar Authentic, and Upper Deck Authenticated. For the trading card collectors, we focus on having a large selection of wax packs and boxes, factory complete sets and single cards graded by Beckett Grading Services and Professional Sports Authenticator (PSA). As we continue to grow our selection, the Amazon Sports Collectibles Store is sure to have something for everybody. Whichever teams or players are your favorite, you should be able to find them amongst our giant selection of Authentic Game Used Merchandise, Autographed Jerseys, Balls, Bats, Shoes, Photos, Helmets, Trading cards, Other Sports Memorabilia and Sports Collectibles. Our new store will also have supplies such as display cases, ball cubes and card protectors, so whether you are adding to your collection, organizing your collection, or buying something as a gift, let the new Amazon Marketplace Sports Collectibles store help you find it.", "parent_text": "Sports & Outdoors", "keyword_density": {"sports collectibles": "5.6", "sports": "5.6"}, "department_id": 14},
{"department_text": "Sports & Outdoors", "level": 1, "url": "http://www.amazon.com/cycling-bikes-bicycles-bike-sale/b/ref=sd_allcat_bike/186-5151927-0681541?ie=UTF8&node=3403201", "text": "Cycling", "description_title": "Bicycles from Amazon.com", "keyword_count": {"bicycles": 6, "bicycles from amazoncom": 2}, "description_wc": 327, "description_text": "Riding your bicycle can be one of the most liberating feelings; feeling the cool rush of air on your face as you exercise is a great way to relax and enjoy the outdoors. The quality bicycles from Amazon.com are purpose-built for a variety of landscapes and riding styles, so you can commute, race, climb, and pedal your way to good health while having a blast. For adults, we have a variety of mountain, racing, hybrid, and cruising bicycles. It doesn\u2019t matter if you\u2019re training or simply pedaling through the neighborhood, our bicycles and bike accessories are ideal for casual or professional uses. For commuters, our hybrid bikes may be just the thing; they\u2019re built to deal with a variety of surfaces and road qualities. They\u2019re the most useful for general use in cities, suburbs, and dirt trails. We also have a variety of kids\u2019 bikes for your children so they can go outside and have fun exercising, too. We have bicycles for every level of rider, from little ones just learning how to balance to extreme youth BMX bikers, you\u2019ll can find the appropriate bicycles and accessories here. If you\u2019re a little late on the birthday shopping, we have a variety of speedy delivery options so you can get your packages on time. The proper protection for any sport or activity is crucial in making sure you can enjoy it for a long time to come. We have helmets for every age group and head size to protect your head from injury. Our locks can also give you peace of mind while you leave your valuable investment safely locked up as you go to work, school, or even just to grab a quick latte. Whether you\u2019re a bike commuter or a velodrome hopeful or just getting your first set of training wheels, you want to ride your bicycle! Get out in the fresh air with the bicycles from Amazon.com.", "parent_text": "Sports & Outdoors", "keyword_density": {"bicycles": "1.8", "bicycles from amazoncom": "1.8"}, "department_id": 14},
{"department_text": "Sports & Outdoors", "level": 1, "url": "http://www.amazon.com/Hunting-Fishing/b/ref=sd_allcat_hntfsh/186-5151927-0681541?ie=UTF8&node=706813011", "text": "Hunting & Fishing", "description_title": "The Amazon Hunting & Fishing Store", "keyword_count": {"amazon hunting fishing store": 2, "fishing": 4, "hunting": 6}, "description_wc": 154, "description_text": "The Amazon Hunting & Fishing Store is the leading online retailer of hunting equipment and fishing tackle. We carry practically everything a sportsman -- or sportswoman -- could need. From spring turkey hunting calls and camouflage to whitetail deer scents, lures, and game cameras, from elk calls, binoculars, and spotting scopes to compound bows, crossbows, arrows, and other archery accessories, we've got you covered. And, of course we carry the widest selection of hunting optics, knives, and gun accessories, no matter your hunting or shooting sport preference. On the fishing side of the business, you'll find tens of thousands of rods, reels, lures, baits, hooks, and other terminal tackle. Whatever your favorite pursuit is -- lunker largemouths, inshore gamefish, or trout on a fly, whitetail deer, bugling elk, or upland birds -- we're confident you'll find what you're looking for in the Amazon Hunting & Fishing Store. Check back often, our selection is constantly growing.", "parent_text": "Sports & Outdoors", "keyword_density": {"amazon hunting fishing store": "5.2", "fishing": "2.6", "hunting": "3.9"}, "department_id": 14},
