{"department_text": "Sports & Outdoors", "level": 1, "url": "http://www.amazon.com/sporting-goods/b/ref=sd_allcat_sg/186-5151927-0681541?ie=UTF8&node=3375251", "text": "All Sports & Outdoors", "description_title": "The Amazon Sports & Outdoors Store", "keyword_count": {"amazon": 3, "amazon sports outdoors store": 2, "store": 5, "sports": 7}, "description_wc": 126, "description_text": "The Amazon Sports & Outdoors Store is the leading online retailer of sporting goods and outdoor equipment. We feature specialty stores in popular categories like Exercise & Fitness, Golf, Skiing & Snowboarding, Cycling, Hunting & Fishing, Camping & Hiking, and Boating & Watersports. But because as an online retailer we enjoy the advantage of \"unlimited\" shelf space, we also feature stores -- and a wide selection of products -- for smaller categories like Skateboarding, Surfing, Paintball & Airsoft, Racquet Sports, and Team Sports. If you're a sports fan check out our Fan Shop. And if you consider yourself a hard-charging athlete check out our new Amazon Athlete store. No matter your sports passion or skill level, we're confident you'll find what you're looking for in the Amazon Sports & Outdoors Store", "parent_text": "Sports & Outdoors", "keyword_density": {"amazon": "2.4", "amazon sports outdoors store": "6.3", "store": "4.0", "sports": "5.6"}, "department_id": 14},
