and socks. With our wide selection of snowboarding gear, we\u2019ll have what you need, so you\u2019ll be able to perform well and stay comfortable and safe on the mountain.", "parent_text": "Outdoor Gear", "keyword_density": {"amazoncom": "0.4", "snowboarding gear": "3.6", "gear": "2.2"}, "department_id": 14},
