{"department_text": "Clothing, Shoes & Jewelry", "level": 1, "url": "http://www.amazon.com/Handbags-Accessories-Clothing/b/ref=sd_allcat_bags/186-5151927-0681541?ie=UTF8&node=15743631", "text": "Handbags", "description_title": "Handbags from Amazon.com", "keyword_count": {"handbags from amazoncom": 1, "handbags": 6}, "description_wc": 370, "description_text": "The ideal handbag can add a pop of color to a neutral top or can dress up a casual look. Outfit-making handbags can set the tone for an entire wardrobe, yet are versatile enough to wear every day. With the right color, shape, and pockets you're looking for, the perfect handbag can be equal parts convenient and stylish--that's why the Amazon Handbag Store carries a wide variety of shapes, sizes, colors, and brands so you can find the perfect fit. We offer a unique, vibrant, and versatile assortment of designer handbags, including clutches, wristlets, cross-body bags, shoulder bags, elegant evening bags, and fun-and-functional top-handle bags. Not sure what kind of bag you want? Browse the latest picks from your favorite designers, like Rebecca Minkoff, Kate Spade New York, and more. Headed out for the night? Easily dress-up your formal wear with an iridescent and studded evening bag. Need something for day-to-day life? Check out structured totes or sporty messenger bags. You don't have to choose between a luxe and practical leather shoulder bag or a flirty clutch?you can have both, thanks to our array of affordable handbags. Need a roomy interior? Check out our range of top-handle and shoulder bags. A slouchy hobo might be just what you seek for those casual and on-trend occasions. What about a simple, sleek design? Simply choose a wristlet or cross-body bag with a chain-link strap for an in-the-know look. We know the interior of quality handbags often matters just as much as what's on the outside. That's why our offerings allow you a visual peek inside your selection while also offering reliable dimensions. These features allow you to rely on our selection of handbags for coordinating lining and the right amount of pocket space. And, if your new handbag doesn't work out, you can return it using our free returns on eligible items. When you find that perfect-for-you handbag, it can be timeless. From party-ready clutches and evening bags to day-perfect totes and shoulder bags, browse our sure-to-please selection of long-lasting handbags from Amazon.com.", "parent_text": "Clothing, Shoes & Jewelry", "keyword_density": {"handbags from amazoncom": "0.8", "handbags": "1.6"}, "department_id": 13},
{"department_text": "Toys, Kids & Baby", "nr_products": 41470, "level": 1, "url": "http://www.amazon.com/Kids-Family/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=471306", "text": "Video Games for Kids", "description_title": "Family Friendly Games from Amazon.com", "keyword_count": {"amazoncom": 4, "games": 7, "friendly": 2, "family": 4}, "description_wc": 270, "description_text": "Apps for Android Bring your family together for some wholesome, good-natured fun with kid-friendly video games. Host monthly teen video game nights and begin a hip, new routine that your gadget-loving family will treasure. Not only do children\u2019s games provide entertainment, but they also teach and inspire, which is why Amazon.com makes it decidedly easy to search for products that appeal to everyone. Want to surprise the kids with the newest and the best? Amazon.com carries a huge collection of games for the handheld PlayStation Vita and Nintendo 3DS, including Super Mario Bros. 2, Angry Birds Trilogy, the Legend of Zelda, Disney Epic Mickey 2, and LittleBigPlanet Karting . These games will encourage children to think with their heads and not just their fingers. We pride ourselves in providing quality entertainment for gamers of all ages and a user-friendly search layout that any family member can navigate. Looking for age-appropriate titles for the wee gamers in your life? Amazon.com\u2019s games for children include releases for the Wii, PlayStation 3, Xbox 360, and PC and Mac. For on-the-go play, Disney Apps for Android , such as Where\u2019s My Perry? and Where\u2019s My Water?, offer a portable and simple gaming experience that will keep your children busy. Shake up your normal routine by searching for best sellers and pre-orders the entire family can enjoy. Imaginative and educational children\u2019s games inspire kids to dream big and think big. Make the most of this learning opportunity and help young minds flourish with video games that entertain and inform from Amazon.com.", "parent_text": "Toys, Kids & Baby", "keyword_density": {"amazoncom": "1.5", "games": "2.6", "friendly": "0.7", "family": "1.5"}, "department_id": 12},
