{"department_text": "Toys, Kids & Baby", "level": 1, "url": "http://www.amazon.com/toys/b/ref=sd_allcat_tg/186-5151927-0681541?ie=UTF8&node=165793011", "text": "Toys & Games", "description_title": "Amazon Toys: More Than Your Average Toy Store", "keyword_count": {"toy store": 2, "toy": 10, "amazon": 1, "store": 6, "toys": 7}, "description_wc": 237, "description_text": "Amazon's Toys & Games Store features thousands of products, including dolls, action figures, games and puzzles, hobbies, models and trains, and much more. You can shop by age, favorite brands, new products, and best sellers. The Preschool Store features learning and educational toys, activity toys, ride-ons, kitchens, and more for the infant or toddler in your life. The Boys' Toy Store showcases all the best in action figures, hobbies, construction, blasters, and outdoor play. The Girls' Toy Store is perfect if you're looking for dolls, plush, dollhouses, and pretend play. Our Games & Puzzles Store showcases the latest in specialty board games, card games, jigsaw puzzles, and more. For the hobby enthusiast we carry everything needed for model building, trains, radio-control vehicles, rocketry, and more. For everyday savings on a wide selection of toys, games, and hobby items, visit our Outlet Store . Our new releases section features the latest products added to our selection, while our best sellers showcase toys and games that are most popular with our customers. Looking for toys and games from your favorite brands in one location? Our featured-brands section showcases entire product selections from top brands, including LEGO , Mattel , Hasbro , Fisher-Price , LeapFrog , and Melissa & Doug , as well as a huge selection of specialty toy brands such as Plan Toys , Bruder , Playmobil , Sprig , Hape , and much more.", "parent_text": "Toys, Kids & Baby", "keyword_density": {"toy store": "1.8", "toy": "4.4", "amazon": "0.4", "store": "2.7", "toys": "3.1"}, "department_id": 12},
