{"department_text": "Beauty, Health & Grocery", "nr_products": 11982, "level": 1, "url": "http://www.amazon.com/Wine-Red-White-Sparkling-Dessert-Rose/b/ref=sd_allcat_wine/186-5151927-0681541?ie=UTF8&node=2983386011", "text": "Wine", "description_title": "Wine", "keyword_count": {"wine": 48}, "description_wc": 388, "description_text": "Amazon Wine is an ideal place to buy wine online, offering a vast selection of wines from iconic brands to enthusiast favorites. Learn about wine by hearing directly from the winemaker about winemaking techniques, wine tasting notes, vineyard details, and wine pairing suggestions. Become a wine connoisseur of your own right by discovering the best wine for your taste preferences, whether it\u2019s dry wines or sweet wines, and by reading wine reviews by other customers. Use our simple filters to sort by type, such as red wine, white wine, ros\u00e8 wine, sparkling wine, and dessert wine. Also, narrow down your choices by wine rating or price, to help you buy the perfect wine for any occasion, whether you are looking for a fine wine or an everyday wine. Examine wine labels online to help you make perfect food and wine pairings or just read wine quotes directly from the winemaker. In our wine store, you can browse through different regions to discover wines from California, Washington, Oregon, and more. Featured wine country regions include Napa Valley, Sonoma, Paso Robles, Walla Walla, Red Mountain, and Willamette Valley. Wine gifts are a popular crowd pleaser during the holidays, and Amazon\u2019s wide selection of wine bottles and gift accessories can help you create wonderful combinations for wine gift baskets that will be loved by friends and family members alike. Or you can choose a unique wine bottle from your favorite vintage to stock your loved ones wine cellars and wine racks. You can also browse our selection of wine glasses, wine openers, wine books, glass markers and more to add something extra special. If you\u2019re an aficionado of red wines, we have just the selection for you, from dry red wine to sweet red wine across multiple varieties. Browse through many varieties of red wines, such as Cabernet Sauvignon, Pinot Noir, Merlot, Malbec, Sangiovese, Syrah, Zinfandel, Cabernet Franc, Tempranillo, and Greneche. Or, if you can\u2019t get enough of delicious white wines, we have a broad selection to choose from whether you prefer a dry white wine or sweet white wine. Browse through many varieties of white wines, such as Chardonnay, Moscato, Pinot Grigio, Pinot Gris, Riesling, Sauvignon Blanc, Semillon, and Viognier. We\u2019ve got great sparkling wine and dessert wine, too, which are perfect for special occasions.", "parent_text": "Beauty, Health & Grocery", "keyword_density": {"wine": "12.4"}, "department_id": 11},
{"department_text": "Toys, Kids & Baby", "nr_products": "13833", "level": 0, "url": "http://www.amazon.com/s/ref=lp_471306_nr_n_12?rh=n%3A468642%2Cn%3A%2144263011%2Cn%3A471306%2Cn%3A294940&bbn=471306&ie=UTF8&qid=1394470647&rnid=11846801", "text": "More Systems", "description_title": "Retro Games from Amazon.com", "parent_url": "http://www.amazon.com/Kids-Family/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=471306", "keyword_count": {"retro games": 7, "amazoncom": 2, "retro": 8}, "description_wc": 334, "description_text": "If you\u2019re the kind of gamer who thinks the industry was at its best before motion-sensing controls and other bells and whistles, browse the retro games at Amazon.com to rediscover your favorite titles from a simpler time. You\u2019ll find a wide selection of retro games for legendary consoles. You can relive the golden age of the home arcade with classic titles for Atari, including Q*Bert, Pac-Man, Frogger, and more. Spurred on the by the popularity of early Atari systems, one of the most successful game consoles of all time was the original Nintendo Entertainment System, originally released in 1985. The cutting edge 8-bit graphics and sound wowed gamers, and titles like Super Mario Brothers, The Legend of Zelda, Castlevania and Final Fantasy are still producing sequels today. You can experience the roots of video game culture with retro games for these and other classic systems. In the \u201890s, televisions got bigger, and gaming consoles got more powerful. Nintendo and Sega fought for the top spot with the Super Nintendo Entertainment System, and the Sega Genesis, respectively. You\u2019ll find all the retro games for SNES and Genesis you loved back in the day in one convenient spot. From Golden Axe to Mega Man X, all your favorite 16-bit titles are available at the Amazon.com Retro games store. Nintendo 64 and PlayStation ushered in a new era of gaming. Polygons replaced pixels, and 3D rendering entered into the gaming vocabulary. Retro gaming hits like Crash Bandicoot, Mario Kart 64, and 007: Goldeneye pushed the limits of technology, and created the most realistic virtual environments seen up to that point. We also have some retro games for systems that might not feel as old as they are, including PlayStation 2, Nintendo GameCube, and the original Xbox. From the moment you get your sword in the Legend of Zelda, to doing a barrel roll in Star Fox 64, now you can relive classic scenes from all your favorite retro games.", "parent_text": "Video Games for Kids", "keyword_density": {"retro games": "4.2", "amazoncom": "0.6", "retro": "2.4"}, "department_id": 12},
