{"department_text": "Toys, Kids & Baby", "nr_products": "1463", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_12?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A166804011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "text": "Pregnancy & Maternity", "description_title": "Pregnancy Supplies from Amazon.com", "parent_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/186-5151927-0681541?ie=UTF8&node=165796011", "keyword_count": {"pregnancy": 9, "supplies": 8, "amazoncom": 2, "pregnancy supplies": 7}, "description_wc": 317, "description_text": "You may not know what to expect when you\u2019re expecting, but you can turn getting ready for a baby can be a fun, nesting experience with the right pregnancy supplies. Amazon.com features a wide selection of pregnancy supplies to get you through all your important stages and times. Our Pregnancy Supplies Store is sorted into convenient categories to make browsing and shopping easier; you\u2019ll easily find the breastfeeding stools, maternity pillows, prenatal monitoring devices, and tests you need all in one place. With well-known brands like LeachCo, Nexcare, and Boppy, we bring you trusted and quality products Whether you\u2019re looking for at-home ovulation and pregnancy tests, an ergonomic body pillow, an accurate digital thermometer, or a sound system for your belly, we carry a variety of pregnancy supplies for comfort, monthly checks, and more. For those trying to get pregnant, you can pinpoint your optimal windows of opportunity with fertility monitors and ovulation tests, while stocking up on pregnancy tests will give you the earliest indication of positive. For those already pregnant, we carry various maternity pillows to snuggle up to, as well as prenatal monitoring devices to even start engaging your little one in utero. Easily filter by brands, subscription option, customer rating, price, and more to further refine your search or simply browse for the pregnancy supplies you need most. We also carry a variety of maternity supplies for the postpartum period to help moms, families, and newborns adjust to their new world. Breastfeeding pillows, covers, and stools are designed with you and your baby\u2019s comfort in mind to help ease the transition to nursing. Available in different materials, designs, styles, and heights, take advantage of our affordable and convenient shipping options to have your new maternity and pregnancy supplies delivered straight to your home. Find the pregnancy supplies you need at Amazon.com, your one-stop baby essentials shop.", "parent_text": "Baby", "keyword_density": {"pregnancy": "2.8", "supplies": "2.5", "amazoncom": "0.6", "pregnancy supplies": "4.4"}, "department_id": 12},
{"department_text": "Toys, Kids & Baby", "nr_products": "8473", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_13?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A166863011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "text": "Safety", "description_title": "Baby Safety from Amazon.com", "parent_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/186-5151927-0681541?ie=UTF8&node=165796011", "keyword_count": {"baby": 12, "amazoncom": 3, "safety": 7, "baby safety": 5}, "description_wc": 342, "description_text": "Whether you have a newborn just home from the hospital or a toddler that's starting to explore the house, the right baby safety products will protect your baby from harm. From tall walk-through gates to bed rails and table edge guards, you can create a safe space for your kids to roam with Amazon.com's large selection of baby safety supplies. Sorted into convenient categories, our variety helps you find all the crib netting, baby monitors, safety caps, harnesses, cabinet locks, bathroom safety products, and other home essentials you need in one convenient place. With many different styles, designs, and items available online from well-known brands FridaBaby, Mommy's Helper, Summer Infant, and more, you can easily shop all your favorites from home. We offer a wide selection of baby safety rails, sleep positioners, gates, monitors, and gear for the bathroom, kitchen, yard, and bedroom--great for babies of all ages and sizes. You can also get the peace of mind you need while keeping your baby safe with easy-to-install, easy-to-use guards, baby doorways, plugs, and latches. With our handy search options, you can easily filter by brand, customer rating, and shipping choices to quickly refine your search. Or simply filter by price and discount for wallet- and baby-friendly choices. Designed with small bodies in mind, baby safety products are a major part of keeping wee ones safe in the world of big people. At Amazon.com, you\u2019ll find the items that will work best for your home: if you have a lot of accessible doors, windows, and cabinets, you can use latches to securely close them. Or if you have pets that aren't ready to be socialized with young members of the family, baby gates with pet doors double their function around the house. In the yard, at home, or on-the-go, you can keep the ouchies and boo-boos to a minimum. With baby safety supplies from Amazon.com, your home can be a safe space to live, learn, and play.", "parent_text": "Baby", "keyword_density": {"baby": "3.5", "amazoncom": "0.9", "safety": "2.0", "baby safety": "2.9"}, "department_id": 12},
{"nr_products": "100954", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_10?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A695338011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "text": "Nursery", "description_wc": 0, "parent_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/186-5151927-0681541?ie=UTF8&node=165796011", "parent_text": "Baby", "department_text": "Toys, Kids & Baby", "department_id": 12},
{"department_text": "Toys, Kids & Baby", "nr_products": "1916", "level": 0, "url": "http://www.amazon.com/s/ref=sr_nr_n_11?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A166887011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "text": "Potty Training", "description_title": "Potty Training from Amazon.com", "parent_url": "http://www.amazon.com/baby-car-seats-strollers-bedding/b/ref=sd_allcat_ba/186-5151927-0681541?ie=UTF8&node=165796011", "keyword_count": {"potty training": 7, "potty": 9, "training": 10, "amazoncom": 3}, "description_wc": 320, "description_text": "If it's time to start the transition to potty training, look to Amazon.com for all your baby essentials to ease the change. From packs of night-time training pants and disposable potty liners to step-up stools and cushioned seats, we feature a wide selection of potty training supplies that make it easier on you and your little ones. Sorted into convenient categories like seat covers, step stools, travel potties, training pants, and potties and seats, all your potty training necessities are just a click away. With well-known brands like Pampers, Arm & Hammer, and Fisher-Price, it's easy to shop for all your favorites from the comfort of your home. Great for babies of all sizes and ages, Amazon.com's variety of potty training supplies will help keep your bathroom clean and ready for whatever is to come. With detailed product descriptions, large photos, and many options to choose from, easily filter by customer rating, shipping options, featured brands, and more to quickly refine your search. You can also filter by price and discount for wallet- and baby-friendly choices. With your baby and the earth in mind, we also offer natural and organic products. No matter where you are with potty training, make sure to stock up on extra supplies, so you are never left high and dry at a critical time. We bring you quality and trusted products designed to hold up to the wear-and-tear of growing up. Character step stools, individual potty chairs, daytime or nighttime training pads, liners, travel seats; it has never been easier to find the potty training essentials you're looking for. And with affordable and convenient shipping options, you can have it all delivered straight to your door step with just one click. Whether you're restocking the shelves or just starting the process, you can find it all at Amazon.com, your one-stop potty training shop.", "parent_text": "Baby", "keyword_density": {"potty training": "4.4", "potty": "2.8", "training": "3.1", "amazoncom": "0.9"}, "department_id": 12},
