{"department_text": "Beauty, Health & Grocery", "nr_products": "6309", "level": 0, "url": "http://www.amazon.com/s/ref=lp_16310101_nr_n_7?rh=n%3A16310101%2Cn%3A%2116310211%2Cn%3A16323111&bbn=16310211&ie=UTF8&qid=1394470651&rnid=16310211", "text": "Baby Foods", "description_title": "Baby Food from Amazon.com", "parent_url": "http://www.amazon.com/grocery-breakfast-foods-snacks-organic/b/ref=sd_allcat_gro/186-5151927-0681541?ie=UTF8&node=16310101", "keyword_count": {"food": 14, "baby food": 9, "amazoncom": 2, "baby": 17}, "description_wc": 374, "description_text": "Make sure your little ones are getting the right nutrients, foods, and nourishment they need to grow up strong. Amazon.com\u2019s selection of baby food can offer your baby the vitamins and minerals they need. To ensure that your little one gets what they need, we have a wide variety of baby food to choose from. From pureed fruit and vegetable baby food packed with vital nutrients to organic infant formula packed with extras, baby food is an important part of your baby\u2019s diet, supplying the protein, iron, and vitamin B they need. We even have completely earth-friendly, organic, and natural food options for added health benefits. When you\u2019re ready to move on to cup or bottle feeding, you can find a wide selection of great liquid options for your baby as well. A staple for many parents, formula contains many of the same nutrients as natural milk and is available in creamy, tasty mixtures perfect for small bodies. Juices made from real fruits can be a healthy snack or in-between meal for your little one. To make drinking their juices and formula easier, we also offer a great selection of bottles and sippy cups in our Baby Feeding Store. We also feature the brands of baby food you know and love, including Gerber, Earth\u2019s Best, Plum Organics, and more. We feature a variety of baby snack foods as well, so when you\u2019re on the go, you can always have something ready for when your baby gets hungry. Check out our great selection of baby food in pouches\u2014a new way to take baby food out wherever you might want to adventure with baby. Convenient and mess-free, baby food in pouches is travel-ready and perfect for on-the-go, busy lifestyles. From biscuits and crackers to fruit pouches and cereals, we also have many sweet flavors that kids love. Our selection of snack foods are made specifically with infants and young children in mind, so you can find the snack foods for baby that don\u2019t have hard edges like big people\u2019s snacks do. Whatever your little ones crave, you can find great tasting baby food in a variety of flavors and textures at Amazon.com.", "parent_text": "Grocery & Gourmet Food", "keyword_density": {"food": "3.7", "baby food": "4.8", "amazoncom": "0.5", "baby": "4.5"}, "department_id": 11},
