{"department_text": "Beauty, Health & Grocery", "nr_products": "6744", "level": 0, "url": "http://www.amazon.com/s/ref=lp_51537011_nr_n_6?rh=n%3A16310101%2Cn%3A%2151536011%2Cn%3A51537011%2Cn%3A16322721&bbn=51537011&ie=UTF8&qid=1394470650&rnid=16310211", "text": "Snack Foods", "description_title": "Snack Foods from Amazon.com", "parent_url": "http://www.amazon.com/Natural-Organic-Grocery/b/ref=sd_allcat_nto/186-5151927-0681541?ie=UTF8&node=51537011", "keyword_count": {"snack foods from amazoncom": 1, "amazoncom": 2, "snack": 11, "foods": 7, "snack foods": 6}, "description_wc": 363, "description_text": "From offering hungry partygoers bite-sized bites for those between-conversation pauses to giving little ones healthy options while out at the park or the zoo, snack foods can feed everyone. When you\u2019re in a pinch between lunch and dinner and need something to tide you over, you can grab everything from healthy fruit snacks to sweet cookies and savory and salty chips. Amazon.com offers a wide selection of snack foods to give you a little pick-me up when you need it most. Whether you\u2019re not in the mood to cook or are out and need to boost your blood sugar, you can choose snack foods in a whole variety of flavors and types. Our selection includes everything from applesauce, fruit cups, breadsticks, chips and crisps, cookies, crackers, dried fruit and raisins, fruit leather, fruit snacks, granola and trail mix bars, ice cream cones and toppings, jerky and dried meats, nuts and seeds, party mix, popcorn, pork rinds, pretzels, pudding and gelatin, puffed snacks, rice cakes, rice crackers, salsas, dips, and spreads, trail mix, wasabi peas, and more. When you crave snack foods but have special dietary needs, you might prefer a variety of specialty options. We offer everything from gluten-free, kosher, low-fat, sugar-free, vegan, nonfat, vegetarian, certified organic, and many more options. With quality brands like Nature Valley, Frito-Lay, Navitas Naturals, Popchips and Annie's Homegrown, you can shop for crispy, crunchy, and delicious options right from home. We even offer Subscribe & Save options to help you save 15% on eligible purchases, give you free shipping, and provide you with regularly scheduled deliveries of your favorite snack foods. As if our wide selection wasn\u2019t enough, our Recipe Center can help you discover quick and tasty recipes for dinner, desserts, snacks, and more. Plus, you can expand your search and browse our selection of beverages, coffee, breakfast foods, baking products, snacks, candy, baby food, pantry staples, gifts, and fresh flowers, and check off everything on your list thanks to our selection of groceries under $10. With snack foods from Amazon.com, you can bite into sweet, savory, and completely delicious pick-me ups of your choice.", "parent_text": "Natural & Organic", "keyword_density": {"snack foods from amazoncom": "1.1", "snack": "3.0", "amazoncom": "0.6", "foods": "1.9", "snack foods": "3.3"}, "department_id": 11},
{"department_text": "Beauty, Health & Grocery", "nr_products": "26", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_p_n_age_range_4?rh=n%3A16310101%2Cn%3A%2151536011%2Cn%3A51537011%2Cn%3A16323111%2Cp_n_age_range%3A6524796011&bbn=51537011&ie=UTF8&qid=1394470654&rnid=6524791011", "text": "24 Months & Up", "description_title": "Baby Food from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_51537011_nr_n_7?rh=n%3A16310101%2Cn%3A%2151536011%2Cn%3A51537011%2Cn%3A16323111&bbn=51537011&ie=UTF8&qid=1394470650&rnid=16310211", "keyword_count": {"food": 14, "baby food": 9, "amazoncom": 2, "baby": 17}, "description_wc": 374, "description_text": "Make sure your little ones are getting the right nutrients, foods, and nourishment they need to grow up strong. Amazon.com\u2019s selection of baby food can offer your baby the vitamins and minerals they need. To ensure that your little one gets what they need, we have a wide variety of baby food to choose from. From pureed fruit and vegetable baby food packed with vital nutrients to organic infant formula packed with extras, baby food is an important part of your baby\u2019s diet, supplying the protein, iron, and vitamin B they need. We even have completely earth-friendly, organic, and natural food options for added health benefits. When you\u2019re ready to move on to cup or bottle feeding, you can find a wide selection of great liquid options for your baby as well. A staple for many parents, formula contains many of the same nutrients as natural milk and is available in creamy, tasty mixtures perfect for small bodies. Juices made from real fruits can be a healthy snack or in-between meal for your little one. To make drinking their juices and formula easier, we also offer a great selection of bottles and sippy cups in our Baby Feeding Store. We also feature the brands of baby food you know and love, including Gerber, Earth\u2019s Best, Plum Organics, and more. We feature a variety of baby snack foods as well, so when you\u2019re on the go, you can always have something ready for when your baby gets hungry. Check out our great selection of baby food in pouches\u2014a new way to take baby food out wherever you might want to adventure with baby. Convenient and mess-free, baby food in pouches is travel-ready and perfect for on-the-go, busy lifestyles. From biscuits and crackers to fruit pouches and cereals, we also have many sweet flavors that kids love. Our selection of snack foods are made specifically with infants and young children in mind, so you can find the snack foods for baby that don\u2019t have hard edges like big people\u2019s snacks do. Whatever your little ones crave, you can find great tasting baby food in a variety of flavors and textures at Amazon.com.", "parent_text": "Baby Foods", "keyword_density": {"food": "3.7", "baby food": "4.8", "amazoncom": "0.5", "baby": "4.5"}, "department_id": 11},
