{"department_text": "Beauty, Health & Grocery", "nr_products": "872", "level": -1, "url": "http://www.amazon.com/s/ref=lp_16322461_nr_n_16?rh=n%3A16310101%2Cn%3A%2116310211%2Cn%3A16322461%2Cn%3A724726011&bbn=16322461&ie=UTF8&qid=1394470658&rnid=16322461", "text": "Marshmallows", "description_title": "Marshmallows from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_16310101_nr_n_2?rh=n%3A16310101%2Cn%3A%2116310211%2Cn%3A16322461&bbn=16310211&ie=UTF8&qid=1394470651&rnid=16310211", "keyword_count": {"marshmallows": 15, "amazoncom": 1}, "description_wc": 330, "description_text": "Whether you\u2019re roasting them over a campfire, or sweetening your hot cocoa, marshmallows are a fun and tasty treat everyone can enjoy. Marshmallows have existed in one form or another for thousands of years. Originally, they were made from the sweet, sticky resin of the marshmallow plant, and used as a remedy for sore throats. Modern marshmallows are significantly fluffier and sweeter, and most are made from gelatin and sugar. At Amazon.com, you\u2019ll find a variety of marshmallows to enjoy, from classic s\u2019mores confections, to cheerful little birds to decorate an Easter basket. Classic marshmallows typically don\u2019t have any color or flavor, but many companies have started adding fun flavors like peppermint, lemon, and strawberry to their marshmallows for a unique twist. Look for small marshmallows to add to cocoa, and extra-large campfire marshmallows to roast over your next bonfire. For an extra special lunchtime treat, make a marshmallow cr\u00e8me and peanut butter sandwich, affectionately referred to as a fluffernutter. To find marshmallows that you like, you can use our helpful product filters. Simply choose the brands, sizes, and flavors you\u2019re interested in, and we\u2019ll create a list of products that fit your criteria. Since most marshmallows have detailed descriptions of their ingredients and sizes, you\u2019ll be sure to choose the right package. If you have any important dietary needs, be sure to check out our specialty stores for gluten-free, organic, and vegetarian options. Although most marshmallows are made with gelatin, we offer several brands made from agar that are suitable for vegetarian diets. In addition to regular campfire-style marshmallows, we offer a variety of other marshmallow products, including marshmallow cr\u00e8me, circus peanuts, marshmallows for breakfast cereal, and many seasonal and decorative marshmallows. Marshmallows are a fun treat for adults and kids of all ages. You can enjoy them all year round, and there\u2019s always a fun new way to incorporate them into a snack or dessert.", "parent_text": "Candy & Chocolate", "keyword_density": {"marshmallows": "4.5", "amazoncom": "0.3"}, "department_id": 11},
