{"department_text": "Toys, Kids & Baby", "nr_products": "85", "level": -1, "url": "http://www.amazon.com/s/ref=sr_nr_n_5?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A166856011%2Cn%3A668893011&bbn=166856011&ie=UTF8&qid=1394470665&rnid=166856011", "text": "Teething Relief", "description_title": "Teething Relief for Babies from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_9?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A166856011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "keyword_count": {"teething relief for babies": 6, "teething relief for babies from amazoncom": 1, "amazoncom": 2, "teething": 8, "relief": 7}, "description_wc": 330, "description_text": "Whether your little one just got his first tooth or has finished his toothy grin, the right teething relief for babies can make all the difference during this process. Help your kids reduce the pain with Amazon.com\u2019s large selection of teething relief for babies. We feature a wide selection of gum massagers, toothbrushes, medicinal gels, and other chewables that can sooth sore gums and crying babes. With different designs, mechanisms, and materials available from well-known brands Zo-li, Oragel, FridaBaby, and more, you can shop for all your favorites from the comfort of your own home. From baby pain gels and natural toothpastes to gum cleansers and low-dose, baby-safe oral anesthetics, find the teething relief for babies you want with ease. Browse large photos and detailed product descriptions for the solution or filter by brands, price, discount, and shipping option to further refine your search. You can even filter by customer rating and bestselling to see highly-rated and popular choices for teething relief for babies. We also include customer reviews right on the product page so you can see how well our selection works with real people. Our selection of products for teething relief for babies features many chewable products as well that are safe for gnawing and gumming on. Teething necklaces are available in a variety of colors and materials that are worn around your baby\u2019s neck for easy access. Many types also include tamper-proof and tension-release clasps so you can quickly remove it when needed, but your baby can\u2019t. Gum massagers often feature textured nubs for excellent pain relief, easy-to-grip handles, and anti-choke shields that prevent over-insertion. And with several shipping options to choose from, you can have it delivered straight to your door with just a single click. You can\u2019t take away the pain completely, but you can help reduce the stress and soreness of teething with teething relief for babies from Amazon.com.", "parent_text": "Health & Baby Care", "keyword_density": {"teething relief for babies": "7.3", "amazoncom": "0.6", "teething relief for babies from amazoncom": "1.8", "teething": "2.4", "relief": "2.1"}, "department_id": 12},
