{"department_text": "Toys, Kids & Baby", "nr_products": "69987", "level": -1, "url": "http://www.amazon.com/s/ref=lp_196601011_nr_p_n_age_range_2?rh=n%3A165793011%2Cn%3A%21165795011%2Cn%3A196601011%2Cp_n_age_range%3A165936011&bbn=196601011&ie=UTF8&qid=1394470666&rnid=165794011", "text": "5 to 7 Years", "description_title": "Infant Toys from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=sr_nr_n_1?rh=n%3A165796011%2Cn%3A%21165797011%2Cn%3A196601011&bbn=165797011&ie=UTF8&qid=1394470647&rnid=165797011", "keyword_count": {"infant toys from amazoncom": 2, "infant": 9, "infant toys": 6, "toys": 10}, "description_wc": 311, "description_text": "Experts say that play is the best way to learn, and now with the quality infant toys from Amazon.com, you can make sure your kids get all the educational playtime they need during their most developmental stages. Musical and sound-making infant toys are popular and fun. They can come with a variety of buttons, pulleys and other features to make the toys roar, squeak, chirp, and more. Our musical toddler toys are great for providing a beat that your child can dance to when they\u2019re energetic. Others play softer lullabies that can be used to soothe them to sleep, and when they do, we have all the plush and stuffed animals your infant or toddler could want to cuddle up with. Stacking and nesting infant toys can help your little one develop valuable motor skills and pattern recognition. On many models, your child will be encouraged to stack their pieces in order from large to small, or based on shape and color. They\u2019ll be absorbed in their game, trying to sort out all the brightly colored pieces in order to complete the puzzle. If you\u2019re puzzling over how to find affordable toys, try filtering your search by price to see the most budget-friendly toddler and infant toys we have available. Many infants, and even some toddlers, love to put their toys, clothes or random found objects in their mouths. For that, we carry many different sizes and styles of teethers. These infant toys are especially designed to be safe and comforting for your baby to chew on. You can choose from a variety of materials, so if your baby prefers softer chewing materials like fluid-filled plastics, we have just the items for them. Infants and toddlers learn at quick speeds, and now you can give them a little more inspiration with infant toys from Amazon.com.", "parent_text": "Baby & Toddler Toys", "keyword_density": {"infant toys": "3.9", "infant": "2.9", "infant toys from amazoncom": "2.6", "toys": "3.2"}, "department_id": 12},
