{"department_text": "Home, Garden & Tools", "nr_products": 1028055, "level": 1, "url": "http://www.amazon.com/Power-Tools-and-Hand-Tools/b/ref=sd_allcat_hi/186-5151927-0681541?ie=UTF8&node=328182011", "text": "Power & Hand Tools", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Power & Hand Tools", "keyword_count": {"tools": 20, "power hand tools": 2, "hand tools": 4, "power": 6, "hand": 6}, "description_wc": 415, "description_text": "Contractors, woodworkers, dry-wallers, builders, plumbers, roofers, and DIY enthusiasts all share one thing: they know that the right tool helps to get a job done right the first time. Having reliable tools held or plugged in creates an environment where work gets done quickly and safely and lets you attempt everything from simply hammering a nail to building a house. And having the right tool means picking out a tool from the right brand, a brand that understands your tool needs. At Amazon.com's Power & Hand Tools Store we have an unbeatable selection of power and hand tool brands, a list that includes top brands such as Bear Grylls Survival Knives, Black & Decker, Bosch, Delta, Denali, DEWALT, Dremel, Fein, Festool, Fluke, Hitachi, JET, Leatherman, Makita, Milwaukee, Porter-Cable, Rockwell Jawhorse, Stanley, and more. These brands have become trusted over time because of their expertise in a wide variety of power and hand tools. Within this long list of brands, you'll be able to find tools for all tasks, starting with the essential power tools for big projects, tools like drills, grinders, rotary tools, routers, saws, sanders, and shears and cordless drills, cordless saws, cordless impact drivers, cordless screwdrivers, and cordless nailers and staplers, and then moving into air tools such as air compressors, nailers, staplers, power sprayers, impact wrenches, sanders, and grinders. And if you're building a bookshelf or doing fine woodworking, you'll want to be sure you have the proper woodworking tools: measuring and layout tools, cutting tools, shaping tools, assembly, finishing tools, and project planning tools. You'll want to stock up on hand tools, multitools, knives, clamps, and wrenches because they come in handy in such a wide range of spots--job sites, camping, around-the-house emergencies, and more. While Amazon.com's Power & Hand Tools Store is focused on tools, tools can't work alone without the right accessories and support and safety products. Round out your workshop and tool collection with batteries, calipers, chargers, chalk lines, clamps, drill bits, dust collectors and air cleaners, ear protection, eye protection, fire extinguishers, gloves, jigs, hardhats, kneepads, levels, line lasers, marking tools, measuring wheels, mobile bases, router bits, rulers, saw blades, scanners and testers, stands, tape measures, tool storage, welding helmets, and workbenches. You'll also find a wide range of deals and special offers on building materials and supplies in the Value Center. Before long, you'll have the right tool and accessory any time you want it.", "parent_text": "Home, Garden & Tools", "keyword_density": {"hand tools": "1.9", "power hand tools": "1.4", "tools": "4.8", "power": "1.4", "hand": "1.4"}, "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": 6048509, "level": 1, "url": "http://www.amazon.com/Tools-and-Home-Improvement/b/ref=sd_allcat_hi2/186-5151927-0681541?ie=UTF8&node=228013", "text": "Home Improvement", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Tools & Home Improvement", "keyword_count": {"home": 6, "tools": 7, "home improvement": 3}, "description_wc": 372, "description_text": "Amazon.com's Tools and Home Improvement Store is an ideal spot for campers, carpenters, contractors, craft enthusiasts, electricians, home-owners, plumbers, tree-trimmers, woodworkers, and those who just want to restock or expand their tool collection or start some serious home repairs. If you've decided to remodel a living room or bathroom, for example, all the necessary fixtures are here, including ceiling fans, ENERGY STAR qualified lighting, lamps, light fixtures, recessed lighting, switches and outlets, and other illuminating items, as well as bathroom faucets, bathroom sinks, bidets, showerheads, toilets, toilet parts, water heaters, and water pumps. If your home repair involves becoming a bit more social there are door chimes and bells for any tastes, and as more people might be stopping by it's not a bad idea to stock up on paint, paint brushes, paint sprayers, solvents, stain, wall stickers and murals, and wallpaper. And to reach the right places, don\u2019t forget ladders and stepladders. Without the proper tools, however, it's probable that most projects aren't going to get done, or at least not be done well. Both tool newbies and hard-core contractors (and every tool collector in-between) can find the right hand tools and power tools here, helpful products such as drills, flashlights, routers, saws, and woodworking tools. To ensure the tools don\u2019t take over a room or garage, a tool organizer is a necessity. Once the project is done, don't forget to put on the finishing touches, the doorknobs and lock sets, garage doors, house numbers, mailboxes, and shelving. To make sure that your work stands strong and safe, remember to get fire safety products, other safety and security products, padlocks and hasps, safes, and security systems. No matter what home improvements or tool-related venture you're taking on, Amazon.com has the trustworthy brands delivering the helpful products you'll want, brands like 3M, Adesso, American Standard, Bosch, Bulbrite, Culligan, DEWALT, Dale Tiffany, Dremel, Elegant Lighting, Filtrete, Honeywell, InSinkErator, Kidde, Kohler, Kwikset, Leviton, Pfister, Roommates, and more. You'll also find a wide range of deals and special offers on tools and home improvement products in the Value Center. Now, all that's needed is deciding where to start.", "parent_text": "Home, Garden & Tools", "keyword_density": {"home": "1.6", "tools": "1.9", "home improvement": "1.6"}, "department_id": 10},
