{"department_text": "Home, Garden & Tools", "level": 1, "url": "http://www.amazon.com/Art/b/ref=sd_allcat_fine_art/186-5151927-0681541?ie=UTF8&node=6685269011", "text": "Fine Art", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Fine Art at Amazon.com", "keyword_count": {"art": 22, "fine art": 5}, "description_wc": 152, "description_text": "Welcome to our new Fine Art store featuring paintings, drawings, mixed media works, photography and art prints. From new artists to famous artists the Fine Art store features artworks and paintings for sale from a multitude of periods and styles including: Pop art, Abstract art, Modern art, Contemporary art, and much more. We focus on highlighting a wide variety of artists, painters, Contemporary artists, Renaissance artists, Modern and Post-Modern artists; find an artist that fits your style in our Fine Arts store. The Fine Arts store features many types of artwork including: canvas prints, abstract paintings, oil paintings, drawings, photography, mixed media works, and collages to add to your home, art gallery, professional workspace or other. As we continue to grow our collections of artworks, the Fine Arts store is sure to have something for everybody whether you are an experienced collector or looking to find your first piece of art.", "parent_text": "Home, Garden & Tools", "keyword_density": {"art": "14.5", "fine art": "6.6"}, "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": 4283519, "level": 1, "url": "http://www.amazon.com/furniture-decor-rugs-lamps-beds-tv-stands/b/ref=sd_allcat_fd/186-5151927-0681541?ie=UTF8&node=1057794", "text": "Furniture & D\u00e9cor", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Furniture at Amazon.com", "keyword_count": {"furniture": 12}, "description_wc": 392, "description_text": "Amazon's Furniture & D\u00e9cor Store showcases an enormous array of styles for any room in the home. Furniture is what defines our living spaces and d\u00e9cor is what completes a home\u2019s atmosphere. It\u2019s so important that the pieces you choose serve your needs and work with your budget. To that end, we\u2019ve featured the main categories front and center: Bedroom Furniture , Mattresses , Living Room Furniture , Office Furniture , Home Entertainment Furniture , Dining Room Furniture , Kids\u2019 Furniture, and Rugs and Frames. Bedroom Furniture includes all the key pieces, plus the extras. We have Beds, Mattresses, Headboards, Dressers, Nightstands, Armoires, Bedding, Vanities, and complete Bedroom Sets. Whether you\u2019re outfitting the master bedroom, the kids\u2019 rooms, or the guestroom, all your bedroom furniture needs are covered here. Refine your search by material, color, price, brand name, and customer reviews. We make it easy to zero in on exactly what you want. We can help you furnish the Living Room and Home Office with form, function, and your wallet in mind. Amazon offers Sofas & Couches, Chairs, Ottomans, Tables, and complete Living Room Sets. With a click, you can choose by style, such as Casual, Contemporary, International, or Traditional. Refine by material, like wood, metal, fabric, leather, and more. The home office department contains Desks, Office Chairs, Bookcases and Cabinets, and much, much more to help you organize and become a master of efficiency. Form, Function, Efficiency\u2014these are all very worth striving for, but it\u2019s really the Home D\u00e9cor that gives a room its inviting atmosphere. We offer picture frames, area rugs, candles, clocks, curtains, decorative pillows, vases, and so much more to give a home your own personal touch and welcoming warmth. Kids\u2019 Furniture and Home Entertainment Furniture add fun and flair. Find dressers and bunk beds, desks and chairs, plus bookcases, cabinets and shelves, all sized to suit the wee ones. When the family\u2019s ready for home entertainment, it\u2019s great to have rooms set and ready with Television Stands, Audio-Video Shelving, Game Tables, Entertainment Armoires, and more. Your home is your nest and your launching pad. Your place for nourishment, rest, fun, and togetherness. Amazon wants it to be easy to shop for and find what you and your family need to create a comfortable and loving home.", "parent_text": "Home, Garden & Tools", "keyword_density": {"furniture": "3.1"}, "department_id": 10},
{"department_text": "Home, Garden & Tools", "level": 1, "url": "http://www.amazon.com/Patio-Lawn-Garden/b/ref=sd_allcat_lp/186-5151927-0681541?ie=UTF8&node=2972638011", "text": "Patio, Lawn & Garden", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Lawn Equipment from Amazon.com", "keyword_count": {"lawn equipment from amazoncom": 1, "lawn": 7, "lawn equipment": 5, "amazoncom": 4}, "description_wc": 313, "description_text": "No matter what the weather is like, your garden and lawn is a great place to relax and take a break from your busy life. Amazon.com carries all sort of lawn equipment to make sure that the time you spend in your front or back yard is as comfortable and inviting as possible. We have a wide variety of lawn equipment to help you with any landscaping and gardening chores. Mowers, trimmers and blowers can make keeping lawns neat and tidy, conveying an extremely welcoming and open environment. Useful watering tools, like heavy-duty hoses and spray nozzles are essential for making sure that all of your garden flowers and veggies get the moisture they need. We also have lawn equipment to help with your gardening, such as pruning shears, spades and germination trays. Once you\u2019ve polished and perfected your front and back yard, it\u2019s time to host a barbeque, and Amazon.com carries everything you need to throw a great outdoor party. You can find propane, natural gas, and charcoal burning grills easily among our outdoor cooking supplies. For serious eats, try special smokers and fryers built especially for outdoor use to give your barbeque unique and unforgettable flavor. We also have the tongs, spatulas, grill scrapers and other outdoor cooking accessories to make grilling fun. Take advantage of the selection of lawn equipment Amazon.com has to help you entertain for your outdoor party. Patio chairs, swinging benches and even hammocks can make it easy to relax and enjoy the peace of your garden. When it gets cold, we have many different styles of outdoor heaters to keep you and your guests warm and cozy. When it gets warmer outside, our pool supplies will help you cool down and keep you ready for a season of wet summer fun. Prepare for the changing seasons with the diverse lawn equipment from Amazon.com.", "parent_text": "Home, Garden & Tools", "keyword_density": {"lawn equipment": "3.2", "lawn": "2.2", "lawn equipment from amazoncom": "1.3", "amazoncom": "1.3"}, "department_id": 10},
