{"department_text": "Home, Garden & Tools", "nr_products": 1590196, "level": 1, "url": "http://www.amazon.com/Arts-Crafts-Sewing/b/ref=sd_allcat_sch/186-5151927-0681541?ie=UTF8&node=2617941011", "text": "Arts, Crafts & Sewing", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Arts and Crafts from Amazon.com", "keyword_count": {"arts": 8, "crafts": 9, "amazoncom": 4, "arts and crafts": 7}, "description_wc": 325, "description_text": "Creating something beautiful or useful out with your own two hands is one of life\u2019s truly rewarding experiences. The feeling of accomplishment and time well spent has had people coming back to arts and crafts throughout history. Today, there are more tools and supplies than ever before to enable you to realize your vision. Whether you\u2019re introducing a curious youngster to arts and crafts for the first time, or if you\u2019ve been steeped in it your whole life, there\u2019s a project waiting for you. The Arts, Crafts, & Sewing Store at Amazon.com is your gateway to a world of unlimited creativity. We offer a huge variety of materials, tools, and supplies for arts and crafts of every discipline. From basics like paper and glue to advanced, computer-controlled equipment for professionals, Amazon.com has the arts and crafts supplies you need to get the most out of your creative hobby. To make it easier to browse our large selection, we provide helpful sorting and filtering tools. You can choose to view items of a certain color, material, or size. Narrowing your choices to the most relevant products is one way we help save you time. Choosing products you know and trust is important, which is why at Amazon.com, we carry top arts and crafts brands such as Martha Stewart Crafts, Brother, Fiskars, and dozens more. Additionally, our user reviews from other customers who have purchased the item you\u2019re interested in can often help you decide whether or not a product is right for you. We\u2019re proud of our customer service at Amazon.com, and we want to give you the best arts and crafts shopping experience we can, by offering conveniences like Free Shipping on many popular products. Whether you\u2019re looking for a new creative way to express yourself, or simply want to expand your repertoire of DIY projects, there\u2019s something for you in the world of arts and crafts.", "parent_text": "Home, Garden & Tools", "keyword_density": {"arts": "2.5", "amazoncom": "1.2", "arts and crafts": "6.5", "crafts": "2.8"}, "department_id": 10},
