{"department_text": "Home, Garden & Tools", "nr_products": "2095", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2619525011_nr_n_29?rh=n%3A2619525011%2Cn%3A%212619526011%2Cn%3A3741521&bbn=2619526011&ie=UTF8&qid=1394470674&rnid=2619526011", "text": "Wine Cellars", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Wine Cellars from Amazon.com", "parent_url": "http://www.amazon.com/Appliances/b/ref=sd_allcat_ha/186-5151927-0681541?ie=UTF8&node=2619525011", "keyword_count": {"amazoncom": 2, "cellars": 7, "wine": 16, "wine cellars": 6}, "description_wc": 305, "description_text": "There\u2019s a wine that suits every occasion, from the most formal get-togethers to backyard barbecues. Whatever the event, Amazon.com has wine cellars, coolers, and racks so you can enjoy the right vintages perfectly stored at the correct temperatures. We have many varieties of electric wine cellars and coolers to choose from. Our smaller, counter-top models are ideal for those who like to occasionally sip wine with dinner, entertain guests, or have a gift bottle ready for special events at a friend\u2019s house. Countertop and under-counter models generally hold between six and 12 bottles, so you can keep a variety of chardonnay and white zinfandels all at once. For collectors, we have electric wine cellars and coolers that can hold 75 bottles or more. Restaurants and sommeliers will love the variety of wines they can chill at the same time. These cellars will give you far more selection when it\u2019s time to choose white wine to go with a plate of grilled salmon in capers. Since they\u2019re electric wine cellars, they come equipped with temperature controls and gauges, so you can always keep your white and sparkling wines properly chilled. If you prefer smooth red wines over sweet whites, we have a variety of wine racks that fit many wine cellars perfectly. Our high-capacity wooden-framed racks can hold a vast supply of vintages, so you can always have the right cabernet sauvignon or Syrah for the occasion. We also offer decorative wooden or metal wine cabinets that can make great decorations in your den or dining room even when you\u2019re not hosting a wine tasting. A collection of wine is always useful to have on hand for events and parties. Wine cellars and chillers at Amazon.com can keep them safely stored for your next get-together.", "parent_text": "Appliances", "keyword_density": {"amazoncom": "0.7", "cellars": "2.3", "wine cellars": "3.9", "wine": "5.2"}, "department_id": 10},
{"nr_products": "257021", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1057792_nr_n_0?rh=n%3A1055398%2Cn%3A%2113900811%2Cn%3A%211063496%2Cn%3A%21251263011%2Cn%3A1057792%2Cn%3A1063236&bbn=1057792&ie=UTF8&qid=1394470674&rnid=1057792", "text": "Bath", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_wc": 0, "parent_url": "http://www.amazon.com/bedding-bath-sheets-towels/b/ref=sd_allcat_bb/186-5151927-0681541?ie=UTF8&node=1057792", "parent_text": "Bedding & Bath", "department_text": "Home, Garden & Tools", "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": "165487", "level": 0, "url": "http://www.amazon.com/s/ref=lp_495224_nr_n_7?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A495224%2Cn%3A5486429011&bbn=495224&ie=UTF8&qid=1394470673&rnid=495224", "text": "Wall Lights", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Wall Lights from Amazon.com", "parent_url": "http://www.amazon.com/lighting-and-ceiling-fans/b/ref=sd_allcat_llf/186-5151927-0681541?ie=UTF8&node=495224", "keyword_count": {"wall lights from amazoncom": 1, "wall": 7, "wall lights": 5, "lights": 10}, "description_wc": 322, "description_text": "If you\u2019re looking for a light fixture that can add depth to rooms without taking up any floor space, we may have the answer for you. Wall lights can add subtle accents to architectural features, or draw the eye to hanging artworks and pictures. Browse our lights to see if there\u2019s something in your style. We have many elegant wall lights for the sophisticated shopper, like candelabras and many sconces. Candelabras look like candles, but use light bulbs so you can keep the romantic ambience without the fire hazard. Lining your hall with candelabras will make you feel like a Victorian-era noble in his or her estate. Our sconces come in a variety of styles that can also add a touch of class and worldly charm. Swinging arm wall lights are great when you want lights that can be adjusted and moved without taking up floor or desk space. They swing out on a simple but sturdy hinge easily. Our wall-mounted reading lights can add a final touch of comfort to your bedroom. Those who read in bed before going to sleep will appreciate such an easy-to-reach lamp, so they can turn off the light without getting out of bed. We also have a variety of night lights for kids so they can drift off peacefully into sleep. Wallchieres are decorative wall lights that diffuse or shine light upwards. They can add unique accents to bedrooms and doorways by providing a torch-like light. Put two in your master bedroom to dramatically frame your bed, or on either side of a special painting or work of art to draw special attention to it. We also have a wide variety of other picture and display lights to give your precious artworks the attention they deserve. The wall lights from Amazon.com offer a space-saving lighting solution that can add sparkle and brilliance to your home d\u00e9cor.", "parent_text": "Lamps & Light Fixtures", "keyword_density": {"wall lights from amazoncom": "1.2", "wall": "2.2", "wall lights": "3.1", "lights": "3.1"}, "department_id": 10},
