{"department_text": "Home, Garden & Tools", "level": 1, "url": "http://www.amazon.com/pet-supplies-dog-cat-food-bed-toy/b/ref=sd_allcat_ps/186-5151927-0681541?ie=UTF8&node=2619533011", "text": "Pet Supplies", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Pet Supplies from Amazon.com", "keyword_count": {"pet": 20, "pet supplies": 6, "pet supplies from amazoncom": 1, "supplies": 7}, "description_wc": 343, "description_text": "Puppies, rabbits, kittens, parrots, rodents, lizards, fish, and other pets all have one thing in common: their humans love them. If you\u2019re bringing home a new pet, or if you\u2019re browsing for something new for an old family friend, we have all the pet supplies you need to ensure your pet\u2019s health and longevity. We have all the pet supplies and food you could need to ensure your critter\u2019s health. If your new little family member eats pellets, kibble, flakes, or veggies, we have what they love. We carry pet food from some of the most trusted names in pet nutrition, including Purina, Kaytee, Fancy Feast, and much more. Nutrition for pets is just as important as it is for us humans; their attitude and energy levels can drastically improve when they\u2019re getting the right vitamins, minerals, and proteins they need. The next step is to ensure your pet\u2019s hygiene. We carry cage liners for a variety of small pets and birds. They\u2019re much easier to deal with than traditional shredded newspaper and sawdust options, because these pet supplies are built to be especially absorptive. We also have kitty litter for cats, training supplies for dogs, and a wide variety of filters for fish. Whether your pet scurries, swims or squawks, make sure they have a clean environment to thrive in. Once you\u2019ve taken care of all the necessary pet supplies, it\u2019s time to get down to the fun part. Pet toys can make spending time with your furry, scaly, or feathered friend even more enjoyable than it already is. There are a variety of toys to enrich caged pets, and there are also balls, climbing structures, and chew toys for larger animals. If you filter your search for pet supplies by price, you can see the most affordable pet toys first, so you can afford to treat your pet to some extra love. Live your life to the fullest, and ensure your pets can do the same with the pet supplies from Amazon.com.", "parent_text": "Home, Garden & Tools", "keyword_density": {"pet": "5.8", "pet supplies": "3.5", "pet supplies from amazoncom": "1.2", "supplies": "2.0"}, "department_id": 10},
