{"department_text": "Home, Garden & Tools", "nr_products": "167", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_11?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A12898411&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "text": "Photography", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Photography Supplies from Amazon.com", "parent_url": "http://www.amazon.com/Arts-Crafts-Sewing/b/ref=sd_allcat_sch/186-5151927-0681541?ie=UTF8&node=2617941011", "keyword_count": {"supplies": 7, "photography": 9, "photography supplies": 5, "photography supplies from amazoncom": 1}, "description_wc": 340, "description_text": "Becoming a photographer takes a lot more than just slinging a DSLR camera around your neck. Let your passion for photography and your eye for composition be fully developed with the help of quality photography supplies. With adequate supplies, you can print, transfer, and retouch photos to turn your snapshots into gallery-worthy works of art. You can find a wide variety of photography supplies to help you make the most of your upcoming projects. Photo coloring kits can add an artful touch to colored or black and white photography, drawing the attention of the viewer dramatically to the subject matter. We have a nice selection of supplies for photography coloring, including photo oil paints, oil pencils, and sheets of gelatin film to color your photographs. Each has their own benefits and techniques, so browse the customer reviews to see how others have enjoyed these photography supplies to get ideas on creative applications. Our photo paper is great for printing out quality prints easily from your home computer. Why would you pay high retail costs for someone else\u2019s artwork when you can cheaply print your own masterpieces right on your desktop. With a simple frame, your home office could become a photographer\u2019s studio, and if you filter you search for photography supplies by price, the transformation can be quite affordable. Once you get your creative juices flowing and photo paper just isn\u2019t cutting it for you anymore, we have just the thing. Our transfer sheets let you print out intricate designs from your computer and then transfer them from the sheets to a variety of surfaces. Some transfer sheets are made for cloth and other textiles, while some adhere better to smooth, hard surfaces. You can use them to personalize your laptop, desk and much more. If you have an SD memory card full of photos, but nothing to do with them, we have just the answer. The photography supplies from Amazon.com make it easy to print and hang your photography to show off to the world.", "parent_text": "Arts, Crafts & Sewing", "keyword_density": {"supplies": "2.1", "photography": "2.6", "photography supplies": "2.9", "photography supplies from amazoncom": "1.2"}, "department_id": 10},
