{"department_text": "Home, Garden & Tools", "nr_products": "60885", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_9?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2237329011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "text": "Needlework", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Needlework from Amazon.com", "parent_url": "http://www.amazon.com/Arts-Crafts-Sewing/b/ref=sd_allcat_sch/186-5151927-0681541?ie=UTF8&node=2617941011", "keyword_count": {"amazoncom": 2, "needlework": 11}, "description_wc": 314, "description_text": "If needlework makes you think of curly-haired grandmothers on rocking chairs, think again. Of course, being a needleworking grandma is awesome, but needlework can be for everyone, as it encompasses such diverse arts and crafts as quilting, embroidery, tapestry, crochet, and much more. With the needlework supplies from Amazon.com, you\u2019ll have everything you need to add flourishes to your clothes, weave scarves, quilt a blanket, and so much more. Quilting is a time-honored, social tradition that can inspire sewing circles and quilting groups. Meet friends while you create cozy needlework quilts. We have everything you need for your quilting projects, including hoops, frames, rotary cutters, cutting mats, and even special quilting machines. Filter our needlework supplies by price to see the most cost-effective materials first. It may save you time and money. Embroidery can liven up plain clothes and turn them into one of your favorite garments to wear. Stitch sequins, beads, and shells onto your clothes for extra texture and sparkle. You can also use embroidery for household convenience. Try working a little design on the hem of your sheets so you know which way the top sheet is supposed to face. Cross stitching is another great needlework activity, perfect for adding smaller, more compact flourishes on textiles. For beginning cross stitch and needlework fans, we have a variety of kits to help you get started. From old-world maps, to flower designs and butterflies, our kits will guide you in creating artworks of all sorts. You can even make your own pillow cases with our predesigned guides and kits. Many of our needlework supplies are eligible for Free Shipping, saving you money on delivery fees. Whether you\u2019re a needleworking grandmother, or you just want to be as awesome, the needlework supplies from Amazon.com are the perfect thing to get you started on a new and fulfilling hobby.", "parent_text": "Arts, Crafts & Sewing", "keyword_density": {"amazoncom": "0.6", "needlework": "3.5"}, "department_id": 10},
