{"department_text": "Home, Garden & Tools", "nr_products": "11571", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2237329011_nr_n_1?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2237329011%2Cn%3A12897251&bbn=2237329011&ie=UTF8&qid=1394470681&rnid=2237329011", "text": "Embroidery", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Embroidery from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_9?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2237329011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "keyword_count": {"amazoncom": 4, "embroidery": 7}, "description_wc": 309, "description_text": "Embroidery is a timeless and beautiful craft that can be enjoyed by creative people of all ages. Whether you\u2019re a seasoned pro with millions of stitches under your belt, or you\u2019re shopping for the budding needle-pointer in the family, Amazon.com offers the embroidery products and accessories you need to create vibrant and long-lasting needlework. For first timers, or those of you looking for a little extra inspiration, we offer embroidery kits and starter packs suitable for all skill levels. Everything from holiday patterns to applique and iron-on transfers can be found in the Amazon.com Embroidery Store. If you\u2019ve been wondering how to spruce up that old throw pillow in the living room, take a look at embroidery kits from Dimensions Needlecraft, Jack Dempsey, or Bucilla. We carry these top brands and more, all easily accessible and convenient to browse and compare. If you\u2019re still not quite sure what to choose, take a look at the customer reviews for nearly any item to read what other shoppers think. Have you ever been frustrated by poorly organized or cluttered embroidery supplies? If so, take a look at our selection of storage solutions. At Amazon.com, we offer floss organizers of every variety, from bobbins, to multi-compartment caddies, to various sized plastic bags for storing incomplete work. With product and feature filtering, you\u2019ll be able find exactly what you\u2019re looking for. You\u2019ll be stitching well into sunset with a nearly endless variety of floss, hoops and needles from Amazon.com. Whether you\u2019re looking for Rayon, cotton, poly, or blended floss, you\u2019ll find it in a variety of weights, plies, and of course, colors. Feel free to expand your palette -- our low prices and convenient shipping options make it easier than ever to find the embroidery supplies that are right for you.", "parent_text": "Needlework", "keyword_density": {"amazoncom": "1.3", "embroidery": "2.3"}, "department_id": 10},
