{"department_text": "Home, Garden & Tools", "nr_products": "29605", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2237329011_nr_n_4?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2237329011%2Cn%3A12897321&bbn=2237329011&ie=UTF8&qid=1394470681&rnid=2237329011", "text": "Quilting", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Quilting from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_9?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2237329011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "keyword_count": {"amazoncom": 3, "quilting": 8}, "description_wc": 320, "description_text": "Quilting is a time-honored traditional craft practiced all over the world. Quilters create beautiful works of art that are enjoyed every day by friends and family. Many quilts are treasured heirlooms, passed down from generation to generation. Whether you\u2019re new to quilting, or you\u2019ve been stitching your whole life, the right materials and tools can help you create gorgeous, comfortable quilts for years to come. From rotary cutters and mats, to computerized quilting machines, and everything in between, you\u2019ll find all the quilting tools you need at Amazon.com. We offer popular brands like Dritz, Clover, Fiskars, and more, so there\u2019s something for even the most meticulous quilters. You can use our convenient product filters to quickly find the items you\u2019re looking for. Simply enter the type of tool or material you\u2019re looking for, and choose a color or style, and we\u2019ll show you products that fit your criteria. Shopping online with Amazon.com is a fast and easy way to get the other quilting materials you need, too. We have a wide selection of batting, pins, notions, and even assorted fabric selections. Our rollups and fat quarters are color-coordinated, and come in a nearly limitless variety of styles, so there\u2019s freedom to dream a big, unique project. Some products are eligible for Free Shipping, so you can get fabric and supplies delivered right to your door at no additional cost. Keep your projects and quilting supplies organized with convenient storage solutions. Whether you need to sort quilting squares, pins and notions, or larger things like mats and cutters, there\u2019s a helpful storage idea for you at Amazon.com. Get to work quicker, and clean up faster by ensuring all your supplies have a proper place. The right tools and materials can help you enjoy quilting, and create beautiful works of art to share with friends and family for years to come.", "parent_text": "Needlework", "keyword_density": {"amazoncom": "0.9", "quilting": "2.5"}, "department_id": 10},
