{"department_text": "Home, Garden & Tools", "nr_products": "15576", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2972638011_nr_n_10?rh=n%3A2972638011%2Cn%3A%213238155011%2Cn%3A553844&bbn=3238155011&ie=UTF8&qid=1394470674&rnid=3238155011", "text": "Pest Control", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Pest Control from Amazon.com", "parent_url": "http://www.amazon.com/Patio-Lawn-Garden/b/ref=sd_allcat_lp/186-5151927-0681541?ie=UTF8&node=2972638011", "keyword_count": {"control": 8, "amazoncom": 2, "pest control": 6, "pest": 8, "pest control from amazoncom": 1}, "description_wc": 281, "description_text": "Don\u2019t let insects and rodents win; fight back and reclaim your home with various pest control options if your insect, rodent, or animal infestation is spiraling out of control. From liquid ant baits to live ladybugs to electronic insect swatters, Amazon.com offers a wide variety of pest control supplies and options. For rodents and other animal pests, depending on whether they\u2019re wanted dead or alive, you have many options. Live animal cage traps work great for small outdoor rodents like chipmunks, squirrels, and weasels as well as indoor mice and rats. For quick traps, we offer a wide range of electronic or snap mouse traps that instantly get the rodent. For larger animals, try an ultrasonic animal repellant or a motion-activated sprinkle to startle and scare them away. Sorted into convenient categories, you can search by type of pest, featured brands, and price to find the perfect solution to your problem. You can also read product reviews right on the page from other customers to see how effective pest control can be. Get insects under control with pest control for ants, mosquitos, spiders, and other creepy crawlers. Hang an electric lantern or lure outside that will attract and kill flying insects like mosquitoes and biting flies. Natural and chemical repellent sprays, powders, and dust will stop bugs on your plants, in your water, and from forming colonies. If you\u2019re worried about chemicals in the air, live pest control like ladybugs, praying mantises, and nematodes actively seek out and eat insects like aphids and mealy bugs. The fight against insects, animals, and rodents ends here: take a stand with pest control from Amazon.com, your 24/7 online ally.", "parent_text": "Patio, Lawn & Garden", "keyword_density": {"control": "2.8", "amazoncom": "0.7", "pest control": "4.3", "pest": "2.8", "pest control from amazoncom": "1.4"}, "department_id": 10},
