{"department_text": "Home, Garden & Tools", "nr_products": "53", "level": -1, "url": "http://www.amazon.com/s/ref=lp_12897011_nr_n_6?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A12897011%2Cn%3A262608011&bbn=12897011&ie=UTF8&qid=1394470684&rnid=12897011", "text": "Sewing Room Furniture", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Sewing Furniture from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_7?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A12897011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "keyword_count": {"sewing furniture from amazoncom": 1, "amazoncom": 2, "sewing": 15, "sewing furniture": 7}, "description_wc": 330, "description_text": "Establishing a dedicated workspace for sewing and textile arts can help you stay focused and productive by ensuring your materials and projects are organized. Specialized sewing furniture that gives you easy access to tools and supplies can be as simple as a storage cabinet for fabrics and patterns, or as robust as a specially built sewing desk for your sewing machine or serger. For projects large and small, it\u2019s crucial to have an adequate surface to measure and cut fabric, and lay out patterns. Sewing furniture often integrates specialized tools like rulers and cutting mats to optimize workflow. Other products are designed to make storing and operating your sewing machine fast and easy. Desks and tables can keep your machine at the right height, and can accommodate power and pedal cords with ease. Some sewing furniture is eligible for FREE Super Saver Shipping, so you can get the items you need delivered straight to your door at no additional cost. Sewing furniture designed for storage can help you organize your crafting area. Cabinets and drawers for keeping track of fabric, thread, and notions will help you quickly find the things you need, when you need them. Keep your sewing room clutter free, and enjoy knowing that your space is ready to use at a moment\u2019s notice. To help you sewing furniture that\u2019s right for you, try out our convenient product filters. Simply choose the colors, materials, and even brands that you prefer, and we\u2019ll show you products that meet your criteria. Beyond sewing furniture, we also offer a wide variety of other sewing tools and supplies. Whether you need new rotary cutter blades, dress forms, or even patterns and fabric, you\u2019ll find what you\u2019re looking for at Amazon.com. Make your sewing room conducive for all your creative and stitchery dreams. You can turn your sewing space into an organized space, and add storage and utility, with a few pieces of sewing furniture from Amazon.com.", "parent_text": "Furniture & Accessories", "keyword_density": {"sewing furniture from amazoncom": "1.2", "amazoncom": "0.6", "sewing": "4.5", "sewing furniture": "4.2"}, "department_id": 10},
