{"nr_products": "12775", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2747968011_nr_n_1?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2747968011%2Cn%3A12896211&bbn=2747968011&ie=UTF8&qid=1394470685&rnid=2747968011", "text": "Boards & Canvas", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_wc": 0, "parent_url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_0?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A2747968011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "parent_text": "Art Supplies", "department_text": "Home, Garden & Tools", "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": "64822", "level": 0, "url": "http://www.amazon.com/s/ref=lp_284507_nr_n_3?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A284507%2Cn%3A289814&bbn=284507&ie=UTF8&qid=1394470675&rnid=284507", "text": "Cookware", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Kitchen Cookware", "parent_url": "http://www.amazon.com/kitchen-dining-small-appliances-cookware/b/ref=sd_allcat_ki/186-5151927-0681541?ie=UTF8&node=284507", "keyword_count": {"cookware": 11, "kitchen": 3}, "description_wc": 424, "description_text": "One of life's truest pleasures, cooking at home is the supreme act of love toward family, friends, and guests. Believe it or not, it can actually be one of life's simplest pleasures, too--provided you're stocked with the right pots and pans for the job. You know from experience that pasta expands when cooked, that tomato sauce spatters something terrible if overheated, and that the right tea kettle can fill your home with the most comforting whistle when the soul-warming brew's ready. That's why it's so important to augment, rethink, and occasionally replace your pots and pans to ensure that your kitchen's ready for each task at hand. For example, Amazon.com offers a full line of individual pots and pans--such as a large stockpot with a sieve inset to make draining those spaghetti noodles a breeze, or a tightly lidded saucepan that keeps the stovetop and surrounding range free from messy splatters. You'll also find entire cookware collections including cast-iron cookware, stainless-steel cookware, copper cookware, and hard-anodized-aluminum cookware--pieces designed to not only perform flawlessly under a variety of applications, but also to look beautiful for effortless kitchen-to-table use. For the professional (or simply adventurous) chef, Amazon.com provides a full range of specialty pots and pans--pieces such as oversized woks for authentic Asian cooking, risotto pans that create perfect versions of the Italian delicacy, and double boilers for melting fine chocolate, cooking European custards, and whipping up homemade fondues, frostings, or fudge. When you know what you need to round out your current cookware--or even if you're just getting started on your cookware collection--you can sort by a number of different criteria in order to narrow in on the right pots and pans for the job. For example, search cookware by ethnicity to find a range of cookware tailored to those spicy Indian dishes or exotic Spanish sides you've been wanting to try. Or, search for cookware by brand or price (or both), and use the customer reviews to help you decide between Rachael Ray's and Wolfgang Puck's lines of non-stick frying pans. Adding just one or two new cookware options can reinvigorate your entire kitchen and redouble your resolve to try that new recipe, which can in turn provide the impetus to invite that couple over for drinks and appetizers--or try your hand at hosting the family Thanksgiving this year. And that's how memories are made.", "parent_text": "Kitchen & Dining", "keyword_density": {"cookware": "2.6", "kitchen": "0.7"}, "department_id": 10},
