{"department_text": "Home, Garden & Tools", "nr_products": "1452", "level": -1, "url": "http://www.amazon.com/s/ref=lp_12897011_nr_n_4?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A12897011%2Cn%3A12897171&bbn=12897011&ie=UTF8&qid=1394470684&rnid=12897011", "text": "Lighting", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Sewing Lights from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_2617941011_nr_n_7?rh=n%3A2617941011%2Cn%3A%212617942011%2Cn%3A12897011&bbn=2617942011&ie=UTF8&qid=1394470677&rnid=2617942011", "keyword_count": {"sewing lights": 7, "amazoncom": 1, "sewing": 11}, "description_wc": 305, "description_text": "Keep your stitches straight and your needles threaded with helpful sewing lights. Sewing and other fine detail work can be difficult to achieve in poor lighting conditions, so make sure every seam and button are well-lit and visible by using a helpful and convenient sewing light. Many sewing lights have integrated magnification to get a good look at your work. For fine details and stitching, a lighted magnifier can help you achieve consistent, professional looking results. Headsets with attached sewing lights and magnifying lenses are perfect for those times when you need both hands free for complex work. At Amazon.com, you\u2019ll find lighted headsets with adjustable brightness, magnification level, and comfort straps, so there\u2019s something to fit everybody. Desktop sewing lights with integrated magnification are adjustable and spring-loaded, so you can move them around quickly to get light where you need it. If you don\u2019t need magnification, there are a wide variety of desktop lamps that are perfect for sewing. LED and fluorescent bulbs provide bright, white light that will evenly illuminate your work, and keep the colors of your fabric vibrant and clear. You can use our convenient product filters to help you find sewing lights that are right for your work space. Choose the brands, colors, and keywords that you\u2019re interested in, and we\u2019ll show you products that meet your criteria. For those times when you just need to take a quick glance at your work, handheld sewing lights are a compact, inexpensive solution. Counting stitches and double checking buttons is easier with a little light and magnification, so be sure to keep a small sewing light handy in your bag or on your work table. Focus on the bigger picture; use magnified sewing lights to double check your fine detail work for professional quality results.", "parent_text": "Furniture & Accessories", "keyword_density": {"sewing lights": "4.6", "amazoncom": "0.3", "sewing": "3.6"}, "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": "1138", "level": -1, "url": "http://www.amazon.com/s/ref=lp_1063316_nr_n_2?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063306%2Cn%3A1063316%2Cn%3A16354791&bbn=1063316&ie=UTF8&qid=1394470686&rnid=1063316", "text": "Serving Carts", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Serving Carts from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_nr_n_9?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A284507%2Cn%3A1063316&bbn=284507&ie=UTF8&qid=1394470675&rnid=284507", "keyword_count": {"carts": 7, "serving carts from amazoncom": 1, "amazoncom": 3, "serving": 8, "serving carts": 4}, "description_wc": 310, "description_text": "Whether you entertain regularly or you just want to have extra bar storage during a gathering, the right serving cart can reduce trips to the kitchen. Serving carts can store everything from extra plates to spare bottles of wine, so you don't have to worry about running back and forth. With extra supplies at your fingertips, you can relax and enjoy time with your friends and family. Amazon.com offers a wide selection of serving carts designed to streamline the serving process. A cart with built-in wine racks, a tea cart or a bar cart set will allow you to store bottles and glassware and provide space for mixing drinks-perfect when you need a movable bar. For parties or gatherings with limited seating, try a tall, wheeled cart that comes with stools and doubles as a table. With serving carts from Amazon.com, you don't have to sacrifice style for function. We offer a wide selection of carts in a range of design styles, so you can find the perfect match for your home. If you have a traditional home, a granite-topped wooden cart or a clean pine design will add just the right touch of style without overwhelming the room. In a more contemporary kitchen, a sleek, chrome-plated cart will fit right in with your decor scheme. For a dramatic statement, a serving cart with large, antique wheels or a carved wooden design can act as a focal point in any room. Whether you're hosting parties or preparing meals for your family, you can turn serving from a chore into a joy with one of the beautiful serving carts at Amazon.com. From utilitarian kitchen carts to stylish bar carts, we understand that a cart should be functionally and aesthetically pleasing-and with our wide selection, you can find the perfect cart for your home.", "parent_text": "Kitchen Furniture", "keyword_density": {"carts": "2.3", "serving carts from amazoncom": "1.3", "amazoncom": "1.0", "serving": "2.6", "serving carts": "2.6"}, "department_id": 10},
