{"department_text": "Home, Garden & Tools", "nr_products": "4842", "level": -1, "url": "http://www.amazon.com/s/ref=lp_1063316_nr_n_3?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A1063306%2Cn%3A1063316%2Cn%3A16354801&bbn=1063316&ie=UTF8&qid=1394470686&rnid=1063316", "text": "Storage Carts", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Storage Carts from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_284507_nr_n_9?rh=n%3A1055398%2Cn%3A%211063498%2Cn%3A284507%2Cn%3A1063316&bbn=284507&ie=UTF8&qid=1394470675&rnid=284507", "keyword_count": {"carts": 10, "amazoncom": 2, "storage carts": 6, "storage": 7}, "description_wc": 284, "description_text": "Storage carts can help keep your home organized, which will enable you to quickly and easily find the things you need around your home and give you more time to spend with your family. At Amazon.com, you can find storage carts to help keep your home organized. Are you looking for a selection of storage carts in a particular style? Choosing the right style is important to ensure that the cart matches the room in which it will sit and matches the overall decor in your home, especially if you will use it in more than one room. Our carts come in a variety of styles, including contemporary, casual and traditional. We carry a wide range of styles, so you can find the perfect one for your home. Do you need a variety of storage carts made with a certain material? Choosing the right material is important because some materials are not appropriate for all storage needs-you wouldn't want to put something private in a cart made of glass or clear plastic. Our carts come in an assortment of materials, including glass, fabric, metal, plastic, stone and wood. We carry a wide range of carts in different materials, so you can find the perfect one for your needs. Are you in search of an assortment of storage carts in a certain color? Choosing the right color allows you to match the decor already in your home. Our carts come in a selection of colors, including black, red, white, gray, blue and purple. When your home is effectively organized, you home feels more comfortable and spacious. You can find a wide selection of storage carts for every room of your home at Amazon.com.", "parent_text": "Kitchen Furniture", "keyword_density": {"carts": "3.5", "amazoncom": "0.7", "storage carts": "4.2", "storage": "2.5"}, "department_id": 10},
