{"department_text": "Home, Garden & Tools", "nr_products": "39980", "level": 0, "url": "http://www.amazon.com/s/ref=lp_2972638011_nr_n_4?rh=n%3A2972638011%2Cn%3A%213238155011%2Cn%3A553760&bbn=3238155011&ie=UTF8&qid=1394470674&rnid=3238155011", "text": "Grills & Outdoor Cooking", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Grilling Supplies from Amazon.com", "parent_url": "http://www.amazon.com/Patio-Lawn-Garden/b/ref=sd_allcat_lp/186-5151927-0681541?ie=UTF8&node=2972638011", "keyword_count": {"grilling supplies from amazoncom": 2, "grilling supplies": 3, "grilling": 7, "supplies": 4}, "description_wc": 306, "description_text": "When the weather gets warmer and the skies clear, it\u2019s a perfect time to relax with a barbeque, and when the skies get cloudy and the cold wind blows, that\u2019s also the perfect time to warm yourself up with some barbeque. Grilling season can last all year thanks to quality grilling supplies from Amazon.com We feature a wide variety of grilling supplies, including the grills themselves. We have many propane, natural gas, and electric-powered grills so you can choose the one that best suits your purposes. Classic charcoal burning grills offer that traditional smoky flavor you grew up with, while our gas and electric grills provide a flavorless heat source, letting your marinades and barbeque sauces take center stage. Wire brushes can also help keep old flavors of last week\u2019s dinner from changing the flavor of your burgers and corn on the cob. For more advanced barbeque masters, we offer smokers, fryers, and Dutch ovens to complete your meat-making arsenal. Smokers come in a variety of shapes and use many different heat sources. You\u2019ll have a lot of fun experimenting with different smoked meats, cheeses, peppers, and more. Dutch ovens are as versatile as any other piece of cooking hardware out there, and can simplify cooking stews, roasts, chilies, and much more. They\u2019re ideal one-pot cookers, which saves on clean-up afterwards. If you\u2019re already happy with your grilling and barbequing setup, we have a variety of grilling accessories and supplies to go with it. We carry everything from essential heavy-duty spatulas, tongs, and forks to high-tech meat thermometers that help you grill the perfect steaks every time. We even have metal or disposable skewers perfect for grilling shrimp, veggies and even marshmallows. Any season is barbeque season thanks to quality grilling supplies from Amazon.com.", "parent_text": "Patio, Lawn & Garden", "keyword_density": {"grilling supplies from amazoncom": "2.6", "grilling": "2.3", "grilling supplies": "2.0", "supplies": "1.3"}, "department_id": 10},
