{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Laptops-Tablets/b/ref=sd_allcat_lapnet/186-5151927-0681541?ie=UTF8&node=2956501011", "text": " Laptops & Tablets", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Laptops, Ultrabooks & Tablets at Amazon.com", "keyword_count": {}, "description_wc": 328, "description_text": "Nowadays, it\u2019s all about portability. More and more of us have left behind the bulky desktop PC for these smaller, more mobile (and these days just as powerful) counterparts. Still haven\u2019t made the leap? Amazon is the perfect one-stop shop for a new laptop, tablet, or Ultrabook. With brands like Acer, Apple, ASUS, Dell, HP, Kindle Fire HD, Lenovo, Samsung, Sony, and Toshiba, you\u2019re sure to end up with a great machine. On the laptop front, you\u2019ll find all the standard styles, whether you\u2019re looking for a PC, Mac, Chromebook, Netbook, touchscreen laptop, Ultrabook, or more. Check out laptop best sellers, peruse our best deals, check out our helpful buying guides, and more\u2014you\u2019ll find just the right laptop model for you. If you\u2019re looking for a powerful, ultra-portable laptop, an Ultrabook may be just the right choice. An Ultrabook is a high-end subnotebook, outfitted with a low-power Intel processor, solid-state drive, and other technologies to give you a featherweight form-factor without losing performance or battery life. If you\u2019re unsure of which Ultrabook would suit your needs, our Ultrabook Buying Guide might be a good place to start. Or perhaps you\u2019re after a tablet? Tablet computing is increasingly popular, and it\u2019s no wonder why. These flat, touchscreen devices let you casually surf the web, enjoy music and video, play games, download and use apps (tablet speak for applications), read eBooks, and so much more. Our Tablet Buying Guide can help you find the right tablet for your needs, or you can check out best sellers, browse by brand, and more to do your research. You can also check out our selection of 2-in-1, aka convertible, machines, which combine a tablet and laptop in one. So whether you\u2019re looking for a laptop, Ultrabook, or tablet\u2014or even some combination of the above\u2014you\u2019ve come to the right place.", "parent_text": "Electronics & Computers", "keyword_density": {}, "department_id": 9},
