{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Electronics-Trade-In/b/ref=sd_allcat_trade_in_elec/186-5151927-0681541?ie=UTF8&node=2226766011", "text": "Trade In Your Electronics", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Tell Us What You Think", "keyword_count": {"think": 1, "us": 2}, "description_wc": 30, "description_text": "We're always looking to improve the customer experience in the Electronics Trade-In Store and would love to hear your feedback. Please let us know what you think .", "parent_text": "Electronics & Computers", "keyword_density": {"think": "3.4", "us": "6.9"}, "department_id": 9},
{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/design-download-business-education-software/b/ref=sd_allcat_sw/186-5151927-0681541?ie=UTF8&node=229534", "text": "Software", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Welcome to the Software Store at Amazon.com", "keyword_count": {"amazoncom": 5, "software store": 4, "software": 20}, "description_wc": 252, "description_text": "The Amazon.com Software Store is the ideal online destination for shopping computer software. Whether you own a Mac or PC, the Amazon.com Software Store has the selection to meet all your software needs. Search software by title, browse by category, and compare software programs until you find exactly the software you\u2019re looking for. If you are building a library of software programs for your home and office, the Amazon.com Software Store has you covered. Shop top Microsoft productivity titles such as Microsoft Office, Microsoft Word, Windows XP, Windows Vista, or recent and new versions like Windows 7 and Windows 8. Or if you are looking to better protect your computer and personal information, shop computer security and antivirus titles from trusted brands like McAfee, Norton, and BitDefender. In the market for photo software, video software, or design software? The Amazon.com Software Store offers a great selection from leading brands such as Adobe and Autodesk, with top titles including Photoshop Elements, InDesign, and Sketchbook Pro. You can also manage and optimize your videos with movie software or DVD software, or even harness your musical creativity with recording software. If you are looking to download software directly to your Mac or PC, you\u2019ve come to the right place. Amazon.com offers a growing collection of top software programs available for instant download to a computer, making the experience of shopping for software online more convenient than ever. Find all the latest software deals including straight price discounts, gift cards with purchase, and more.", "parent_text": "Electronics & Computers", "keyword_density": {"amazoncom": "2.0", "software store": "3.2", "software": "7.9"}, "department_id": 9},
{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/PC-Parts-Components/b/ref=sd_allcat_components/186-5151927-0681541?ie=UTF8&node=193870011", "text": "Computer Parts & Components", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Computer Parts and Components from Amazon.com", "keyword_count": {"amazoncom": 2, "computer parts": 5, "computer": 11, "components": 4, "computer parts and components": 1}, "description_wc": 315, "description_text": "If you\u2019re looking to repair, build, or upgrade your computer, you can find the components and computer parts you need at Amazon.com. We have a wide variety of computer parts and components, so whether you\u2019re trying to build a computer from the ground up or you just need to replace a few things for optimal performance, you can find what you need. Our hard disk drives and solid state drives come in a wide variety of capacities to hold all of your games, music, movies, and TV shows without a problem., and our high-performance sound cards and graphics cards can help you create the ultimate entertainment experience with crisp pictures and life-like sounds. For those who want to build their own tower, we carry the computer parts and hardware to get you started. We have a great selection of computer cases and chasses in metal or plastic, with USB 3.0 capabilities, windowed side panels, and amazing designs. We also have reliable and fast processors from some of the top manufacturers, including Intel, AMD, Corsair, Kingston, Crucial for Memory, and more. If you\u2019re shopping for computer parts on a budget, try filtering our processors, SSDs, or other components by price, by used or refurbished models, and even by discount to see some of the most affordable options available. For a faster computer experience, we carry many different memory modules to boost your RAM. Increasing your memory by one to 16 gigabytes can significantly improve your multitasking abilities so you can go between video chatting, playing games, listening to music and more without your computer getting bogged down by all the open applications. We even have an assortment of ergonomic, purpose-built, and other input devices to give you more control over your user interface. Find the components and computer parts you need to repair, build, or upgrade your computer at Amazon.com.", "parent_text": "Electronics & Computers", "keyword_density": {"amazoncom": "0.6", "computer parts": "3.2", "computer": "3.5", "components": "1.3", "computer parts and components": "1.3"}, "department_id": 9},
{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Desktops/b/ref=sd_allcat_deskserv/186-5151927-0681541?ie=UTF8&node=4972214011", "text": "Desktops & Monitors", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Desktop Computers & Monitors at Amazon.com", "keyword_count": {"desktop computers": 4, "desktop": 5}, "description_wc": 268, "description_text": "Desktop computers are far from dead. Avid gamers, media professionals, or just home users looking for serious expandability all still look to desktop computers to suit their needs, and there are plenty of great machines available. Check out the best in desktop computers here at Amazon, from brands like Acer, Alienware, Apple, ASUS, CyberpowerPC, CybertronPC, Dell, Gateway, HP, iBUYPOWER, Lenovo, Sony, and Toshiba. You can check out our Desktop Buying Guide to find out a bit more about the right machine for you. Maybe you\u2019re looking for a newer all-in-one PC, where the monitor and CPU are a single unit, saving you all kinds of space in setting it up. Or maybe you\u2019re after the latest and greatest gaming PC--a good gaming PC is a cut above the average machine, with enhanced graphics, processing power, a supercharged cooling system, and other features to keep it at peak performance. Whether it\u2019s a gaming PC or any other type, you\u2019ll be covered here. Shop by price, brand, and other criteria such as desktop computers with a specific processor type (AMD or Intel). Check out best sellers, new releases, top rated and most gifted machines, and more. Once you\u2019ve picked out your machine you\u2019ll need to pick a monitor. Amazon has you covered there as well. Look for a monitor by size, check out monitor best sellers, choose between LCD and LED monitor types, and more. Whether you\u2019re after a massive high-definition monitor (for that gaming PC rig) or something a bit more modest, you\u2019ll find it here.", "parent_text": "Electronics & Computers", "keyword_density": {"desktop computers": "3.0", "desktop": "1.9"}, "department_id": 9},
{"department_text": "Home, Garden & Tools", "nr_products": "116", "level": -1, "url": "http://www.amazon.com/s/ref=lp_511332_nr_p_n_is_ffp_0?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A511228%2Cn%3A511332%2Cp_n_is_ffp%3A7252855011&bbn=511332&ie=UTF8&qid=1394470693&rnid=7252854011", "text": "Frustration-Free Packaging", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Fasteners from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_511228_nr_n_10?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A511228%2Cn%3A511332&bbn=511228&ie=UTF8&qid=1394470672&rnid=511228", "keyword_count": {"fasteners from amazoncom": 1, "amazoncom": 2, "fasteners": 6}, "description_wc": 339, "description_text": "Sometimes it can seem like everything in your home decides to fall apart at the same time. With the proper fasteners, keeping everything where it should be won\u2019t be a problem. Everything from cords and wires to photo frames and drywall can be put in its place easily. At Amazon.com, we have fasteners of all sorts, shapes, and sizes. Our wide variety of bolts, screws, and nails means you can find exactly what you need for your next DIY project. Whether you\u2019re building a new table, birdhouse or scale-model catapult, the right sized bolts and nails are crucial. We even have especially made picture hangers, so there\u2019s no need to constantly straighten painting that hang by a single nail. If you\u2019re on a tight schedule, our different shipping options mean you can get your fasteners as quickly as you need them. Zip ties and cable ties are very affordable fasteners. Bind and organize just about everything with these versatile items. Cable ties are extremely useful for a variety of projects, like organizing network cables and computer desks, sorting items at your workbench, and more. Our snaps are great for keeping keys, access cards, and other small objects from getting lost. To make it easier for friends, family, baby-sitters, or dog-walkers to come into your home, use a snap to hide your keys in a secret location. Liquid fasteners are ideal for decorating and fixing broken objects. You can find trusted brands like Gorilla Glue, Franklin International, Quakehold!, and more to help you with your home improvement projects. You can make your own refrigerator magnets by gluing a small, magnetic disk to the back of any object. Or try this: make your own kissing salt and pepper shakers by gluing small magnets on the insides of the shakers. Things fall apart. If you\u2019re going crazy with all the repairs and remodeling you have to do around the house, we\u2019re here to help. Keep it together with the fasteners from Amazon.com.", "parent_text": "Nails, Screws & Fasteners", "keyword_density": {"fasteners from amazoncom": "0.9", "amazoncom": "0.6", "fasteners": "1.8"}, "department_id": 10},
{"department_text": "Home, Garden & Tools", "nr_products": "1384", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13397631_nr_p_72_3?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A3754161%2Cn%3A13397631%2Cp_72%3A1248912011&bbn=13397631&ie=UTF8&qid=1394470695&rnid=1248907011", "text": "& Up", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Water Softeners from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_3754161_nr_n_2?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A3754161%2Cn%3A13397631&bbn=3754161&ie=UTF8&qid=1394470672&rnid=3754161", "keyword_count": {"water": 17, "water softeners": 6, "softeners": 7, "amazoncom": 1}, "description_wc": 319, "description_text": "Do you live in an area with hard water? If so, you\u2019re probably familiar with the unsightly residue hard water deposits leave on faucets, fixtures, and surfaces. Limescale deposits can even obstruct plumbing, potentially leading to costly repairs. Water softeners are designed to remove the minerals from your water throughout your whole house, eliminating any risk of damaging residue. Water softeners treat all the water in your home, so you can enjoy soft, low-mineral water from every tap and faucet. Several basic types of water softeners are available. The most common type uses \u201csoftening salts\u201d to remove unwanted calcium and magnesium from the water supply. Another variety uses small beads made of a material called ion exchange resin to soften your water. Both styles are effective, and work well in large and small homes. You can read product descriptions to learn more about the technical details of many water softeners. At Amazon.com, we offer replacement cartridges and salts for a wide variety of water softeners. You\u2019ll find refill products from popular brands like Morton, Nuvo, and Aquios, so no matter what water softener you use, you\u2019ll be sure to find all the supplies you need to keep it working. Shopping online makes it easy to compare similar products, and be sure you buy exactly the supplies you need. In addition to water softeners, we also offer water filters and purifiers. There are a variety of filtering options-- from individual taps, to your fridge and freezer, to your entire home--that will remove lead and mercury, particulates, and other harmful substances. Our convenient product filters can help you find the softeners and filters you\u2019re interested in. Simply choose the brands, and features you want, and we\u2019ll show you items that meet your criteria. Prevent costly limescale deposits and stubborn mineral residue by treating all the water in your home with an effective water softener.", "parent_text": "Water Filtration & Softeners", "keyword_density": {"water": "5.3", "water softeners": "3.8", "softeners": "2.2", "amazoncom": "0.3"}, "department_id": 10},
