{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Tech-Accessories-Electronics/b/ref=sd_allcat_elec_acc/186-5151927-0681541?ie=UTF8&node=5745855011", "text": "Electronics Accessories", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Welcome to the Consumer Electronics Accessory Store at Amazon.com", "keyword_count": {"consumer electronics accessory store": 1, "electronics accessory": 3, "electronics": 5, "amazoncom": 1, "accessory": 4}, "description_wc": 158, "description_text": "Amazon\u2019s Consumer Electronics Accessory Store is your one-stop shop for all your electronics accessories needs. Don\u2019t know what electronics accessory or peripheral you\u2019re looking for? We are here to help. Check out our accessories in the Computers, Tablets, Office, Cameras, Cell Phones, GPS, Audio & Video, MP3, Car Electronics, or Kindle categories and find your perfect accessory. With our huge selection of cables, adapters, batteries, chargers, cases, bags, covers, sleeves, stands, mounts, power protection, ink, toner, and headsets from popular brands like HP, Canon, Belkin, OtterBox, Monster, Sony, Brother, Logitech, Apple, Sennheiser, Bose, and more, we have something for every electronic and gadget buyer. Whether your budget is limited or not, we consistently work toward maintaining competitive prices on every electronics accessory we carry. And with customer benefits such as Amazon Prime and FREE Super Saver Shipping , you can shop with confidence at Amazon.com, as we strive to give you the best customer experience.", "parent_text": "Electronics & Computers", "keyword_density": {"consumer electronics accessory store": "2.5", "electronics accessory": "3.8", "amazoncom": "0.6", "electronics": "3.2", "accessory": "2.5"}, "department_id": 9},
{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/186-5151927-0681541?ie=UTF8&node=11091801", "text": "Musical Instruments", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Amazon.com's Musical Instruments Store", "keyword_count": {"musical instruments store": 2, "instruments": 6, "amazoncom": 3, "musical instruments": 5, "musical": 6, "store": 5}, "description_wc": 277, "description_text": "Welcome to the Musical Instruments Store at Amazon.com. From stage to studio, this is your source for the gear you need to perform your best--whether you\u2019re a beginner or a seasoned musician. Browse our selection of guitars, keyboards, basses, amps, drums, stringed instruments, band & orchestra, DJ gear, and more to get set up with the perfect instrument. Check out the latest recording equipment, from microphones to monitors and audio interfaces to DAW software. Take care of your live sound needs with power amps, speakers, and cables galore. Pick up some pro lighting effects for your next gig. Or how about some fun kids\u2019 musical instruments to get \u2018em started at a young age? Whatever your goal--outfitting a venue, recording a rock & roll masterpiece, DJing parties, learning violin--Amazon has you covered. Check out top deals, gift ideas, best-selling gear, and featured brands such as Fender, Gibson, Line 6, Pearl, M-Audio, Avid, Shure Microphones, Zildjian, Sabian, Peavey, Epiphone, Yamaha, Casio, and hundreds more. Take advantage of Amazon Prime shipping, financing with the Amazon.com Store Card, and other special offers. Browse our special stores, such as the Beginner Store for students and those just starting out, or the Musical Instruments Outlet, featuring huge markdowns on all kinds of gear and equipment. Need accessories for your instrument? No problem\u2014pick up some strings, sticks, reeds, picks, stands, tuners, or anything else you might need from our huge selection. And, as with all things Amazon.com, check out customer reviews of musical instruments to help make your choice. Whatever your musical needs, you\u2019ll find it here in the Musical Instruments Store. Start making some music today!", "parent_text": "Electronics & Computers", "keyword_density": {"musical instruments store": "2.2", "instruments": "2.2", "amazoncom": "1.1", "musical instruments": "3.6", "musical": "2.2", "store": "1.8"}, "department_id": 9},
{"department_text": "Home, Garden & Tools", "nr_products": "4481", "level": -1, "url": "http://www.amazon.com/s/ref=lp_2380871011_nr_n_2?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A511228%2Cn%3A2380871011%2Cn%3A511238&bbn=2380871011&ie=UTF8&qid=1394470695&rnid=2380871011", "text": "Drawer Slides", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Drawer Slides from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_511228_nr_n_3?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A511228%2Cn%3A2380871011&bbn=511228&ie=UTF8&qid=1394470672&rnid=511228", "keyword_count": {"slides": 12, "drawer": 12, "amazoncom": 2, "drawer slides": 7}, "description_wc": 331, "description_text": "Beautiful old dressers and drawers are often wonderful to look at, but a challenge to own because of outdated, sticky drawer slides. Save money and keep your classic furniture by adding new, smooth drawer slides. There\u2019s more to drawer pulls than meets the eye or the fingers. At Amazon.com, you can find a range of handy features can make your drawers behave differently. Ball bearing slides operate smoothly throughout their range with no sticking or jitters. Full extension slides are great for deeper drawers that need to open further than normal. For drawers with fragile contents, soft close slides will prevent accidental slamming, and possible damage. Our keyword filters make it easy to browse for drawer slides with the options you want. Just because drawer slides are usually hidden from view doesn\u2019t mean you don\u2019t want to match existing hardware if you\u2019re replacing worn out parts. Filtering for color, finish and brand will help you locate the part you need quickly. For rapid repairs, we offer fast expedited shipping options. If you\u2019re replacing several drawer slides all at once and want to stay within a budget, you can take a look at products that are eligible for Free Shipping. Either way, online shopping is a convenient resource for all your home repair needs. If you\u2019re in the mood for a DIY furniture project, try converting the sticky old slides in a second hand dresser or cabinet to new, fully featured ball bearing slides. It\u2019s amazing how much of a difference quality drawer slides can make with old furniture. Rejuvenating retro storage pieces is just one of the ways you can enjoy simple and affordable projects from Amazon.com. Making sure the little things in your home function the way they should is a great way to reduce everyday stress, and enjoy your furniture. Drawer slides are affordable and easy to install in most furniture, so there\u2019s nothing holding you back from making positive changes.", "parent_text": "Cabinet Hardware", "keyword_density": {"slides": "3.6", "drawer": "3.6", "amazoncom": "0.6", "drawer slides": "4.2"}, "department_id": 10},
