{"department_text": "Electronics & Computers", "nr_products": "15025", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_4?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A405758011&bbn=11965861&ie=UTF8&qid=1394470698&rnid=11965861", "text": "Band & Orchestra", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Band & Orchestra Instruments from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/186-5151927-0681541?ie=UTF8&node=11091801", "keyword_count": {"instruments": 9, "orchestra": 11, "band orchestra": 1, "band": 11, "amazoncom": 1, "orchestra instruments": 3}, "description_wc": 439, "description_text": "One of the great pleasures of life is the beautiful sound made by the harmony, cooperation, and synchronization of many instruments in unison. Playing music in a band or orchestra--from classical chamber music ensembles to peppy marching band performances\u2014is one of the most beloved forms of making music together with other people. Whether it\u2019s the drama of a crescendo in the orchestra or the toe-tapping rhythms of a big band performance, playing an instrument with others is a great way to add music to your life. In celebration of students of music everywhere, Amazon.com offers quality band and orchestra instruments and accessories to fully equip our customers with some of the best musical equipment on the market. In our Band & Orchestra store, you can find the instruments and accessories you\u2019re looking for--from woodwinds and brass to orchestral strings--instruments that are great for both students and masters of the musical craft. Browse our string instrument selection for a variety of cellos, violins, and violas from some of the most popular names in orchestra instruments, including Mendini, Yahama, and Cecilio. Our instrument accessories, such as resin for your bows and replacement strings, can keep you fiddling and pizzicato-ing to your heart\u2019s content. Our selection of brass instruments and woodwinds is unparalleled. Because they\u2019re lightweight and versatile, brass and woodwinds are great starting instruments for younger band and orchestra students. French horns, baritones, bugles, sousaphones, trumpets, cornets, and euphoniums come in a variety of finishes and metal plating, so you can choose the right equipment recommended by the music teacher. You can even find colored trombones for maximum pep and school spirit. For the woodwind players in your life, you can find the rich and warm sounds of a wide selection of woodwind instruments, from bassoons, clarinets, English horns, and oboes, to flutes, piccolos, recorders, and saxophones. You\u2019ll also find the accessories and parts to keep your instrument clean and to protect your sound quality and investment. Band and orchestra percussionists will appreciate how easy it is to find the right snares, basses, sticks, mallets, and accessories. For marching bands, we offer carriers and slings that drum lines need to hold up their drums. They\u2019re strong and reliable, freeing your hands to rap out intricate beats and drum rolls. Band and orchestra cymbals are ideal for pieces that require their colorful and dramatic splashes of sound. Add the beauty of band and orchestra music to your life. From the budding violinist, to the master of jazz saxophone, you\u2019ll find quality band and orchestra instruments for all your musical endeavors.", "parent_text": "Musical Instruments", "keyword_density": {"instruments": "2.1", "orchestra": "2.5", "band orchestra": "0.5", "band": "2.5", "amazoncom": "0.2", "orchestra instruments": "1.4"}, "department_id": 9},
