{"department_text": "Home, Garden & Tools", "nr_products": "1305", "level": -1, "url": "http://www.amazon.com/s/ref=lp_13397631_nr_p_72_2?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A3754161%2Cn%3A13397631%2Cp_72%3A1248911011&bbn=13397631&ie=UTF8&qid=1394470695&rnid=1248907011", "text": "& Up", "department_url": "http://www.amazon.com/s/ref=lp_284507_ex_n_1?rh=n%3A1055398&bbn=1055398&ie=UTF8&qid=1393338782", "description_title": "Water Softeners from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_3754161_nr_n_2?rh=n%3A228013%2Cn%3A%21468240%2Cn%3A3754161%2Cn%3A13397631&bbn=3754161&ie=UTF8&qid=1394470672&rnid=3754161", "keyword_count": {"water": 17, "water softeners": 6, "softeners": 7, "amazoncom": 1}, "description_wc": 319, "description_text": "Do you live in an area with hard water? If so, you\u2019re probably familiar with the unsightly residue hard water deposits leave on faucets, fixtures, and surfaces. Limescale deposits can even obstruct plumbing, potentially leading to costly repairs. Water softeners are designed to remove the minerals from your water throughout your whole house, eliminating any risk of damaging residue. Water softeners treat all the water in your home, so you can enjoy soft, low-mineral water from every tap and faucet. Several basic types of water softeners are available. The most common type uses \u201csoftening salts\u201d to remove unwanted calcium and magnesium from the water supply. Another variety uses small beads made of a material called ion exchange resin to soften your water. Both styles are effective, and work well in large and small homes. You can read product descriptions to learn more about the technical details of many water softeners. At Amazon.com, we offer replacement cartridges and salts for a wide variety of water softeners. You\u2019ll find refill products from popular brands like Morton, Nuvo, and Aquios, so no matter what water softener you use, you\u2019ll be sure to find all the supplies you need to keep it working. Shopping online makes it easy to compare similar products, and be sure you buy exactly the supplies you need. In addition to water softeners, we also offer water filters and purifiers. There are a variety of filtering options-- from individual taps, to your fridge and freezer, to your entire home--that will remove lead and mercury, particulates, and other harmful substances. Our convenient product filters can help you find the softeners and filters you\u2019re interested in. Simply choose the brands, and features you want, and we\u2019ll show you items that meet your criteria. Prevent costly limescale deposits and stubborn mineral residue by treating all the water in your home with an effective water softener.", "parent_text": "Water Filtration & Softeners", "keyword_density": {"water": "5.3", "water softeners": "3.8", "softeners": "2.2", "amazoncom": "0.3"}, "department_id": 10},
