{"department_text": "Electronics & Computers", "nr_products": "7413", "level": 0, "url": "http://www.amazon.com/s/ref=lp_11091801_nr_n_7?rh=n%3A11091801%2Cn%3A%2111965861%2Cn%3A11973881&bbn=11965861&ie=UTF8&qid=1394470698&rnid=11965861", "text": "DJ, Electronic Music & Karaoke", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "DJ Equipment from Amazon.com", "parent_url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/186-5151927-0681541?ie=UTF8&node=11091801", "keyword_count": {"equipment": 6, "amazoncom": 2, "dj": 10, "dj equipment": 4}, "description_wc": 328, "description_text": "Being a DJ is about spinning a mixture of music, lighting, and timing to create ambience and the perfect environment for guests to enjoy their night out. With the DJ equipment and synthesizers from Amazon.com in your booth, you can drop beats with the best of them. Our DJ mixers, controllers and other equipment can help you scratch, mix, loop and more with ease. Ditch the vinyl, now you can hook up electronic turn tables to your computer or MP3 player and mix your entire library. Many of our models are portable enough that you can always be ready to DJ at a moment\u2019s notice. If you need your DJ equipment fast, we have a variety of expedited shipping options, so you can get the party started on time. When the club or the party gets loud and rowdy, every DJ needs a reliable pair of headphones. You need to keep an ear for the musical cues, and make sure the levels are right to ensure a smooth, musical experience. Our DJ headphones block out ambient noise and keep your monitoring cues out of your microphones. Used with your own home computer, our drum machines, synthesizers, and other DJ equipment can even help you create original mixes, mash-ups, and tracks. Now that you have your music all set up, it\u2019s time to add a little light show. We carry a variety of DJ lighting and equipment, including laser lights, fog machines, mirrored disco balls, and more so you can set the mood. Our ribbons of LED lights are ideal for marking off dance floors, adding accent to the architecture of a venue, and decorating to your booth. Our strobes are ideal for when the beat picks up and you want to let the dancers get lost in a sensory experience. When you need an extra oomph to get your next party, reception, or school dance bumping, check out the selection of DJ equipment at Amazon.com.", "parent_text": "Musical Instruments", "keyword_density": {"equipment": "1.8", "amazoncom": "0.6", "dj": "3.0", "dj equipment": "2.4"}, "department_id": 9},
