{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/186-5151927-0681541?ie=UTF8&node=502394", "text": "Camera, Photo & Video", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Camera, Photo & Video", "keyword_count": {"photo": 5, "camera photo video": 1, "camera": 15}, "description_wc": 283, "description_text": "Amazon.com has a huge selection of cameras and accessories for every type of photographer. Looking for a pocket-sized camera for those unforgettable moments? Amazon.com has a huge selection of cameras small enough to keep with you everywhere you go. If you are looking for something in the professional realm, Amazon.com has a wide selection of the newest and most precise Digital SLR cameras with all the lenses and accessories to help you get that perfect image. Looking for something in between? Our broad range of compact system cameras has everything you need to start building your digital portfolio. From the smallest, most agile point & shoot digital cameras to the professional level Digital SLR cameras, Amazon.com's Camera, Photo & Video store has something for everyone. We feature the newest models from the biggest brands in photography such as Canon, Nikon, Panasonic, Sony, Olympus, and Panasonic. We not only have the base camera models, but also a plethora of lenses and accessories for every situation. If you are looking for a specialty camera, Amazon has a variety of underwater and kid\u2019s cameras as well. Our selection of underwater cameras has everything for the most hard core scuba divers as well as the cautiously clumsy. These can help you capture those incredible underwater photos or just keep your camera safe at the beach. Our children\u2019s cameras come in a variety of themes and colors and are an excellent way to inspire kids to show the unique way they see their world. All of this comes with the largest selection of reviews with the lowest prices around. So find that perfect camera for you or the perfect gift for the photographers closest to you.", "parent_text": "Electronics & Computers", "keyword_density": {"photo": "1.8", "camera photo video": "1.1", "camera": "5.3"}, "department_id": 9},
{"department_text": "Movies, Music & Games", "level": 1, "url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=468642", "text": "Video Games", "description_title": "Video Games from Amazon.com", "keyword_count": {"video": 6, "amazoncom": 3, "video games": 5, "games": 9}, "description_wc": 227, "description_text": "Amazon\u2019s Video Games store is your entertainment hub for everything related to Video Games. The store features thousands of games at great prices and allows you to shop by gaming platform, bestsellers, new and future releases, bonus offers, price, deals, genre, ESRB rating, and more. You can shop for every type of game you may be looking for, including Xbox 360 , PlayStation 3 , PlayStation 4 , Nintendo Wii and Wii U, Nintendo 3DS, PlayStation Vita, Digital, Free-to-Play, Kindle Fire, PC and Mac, Nintendo DS, and much more. When you\u2019re looking to join in on the hottest new video game developments online, there\u2019s no better place to be than Amazon.com. Our new & future releases section features the latest games and newest pre-order options. Its streamlined, hassle-free pages are perfect for locating new video games in seconds, so you\u2019ll be at the forefront of all the action and right in line with even the most hardcore gaming aficionados. No matter which gaming system you use, Amazon.com offers the latest updates and releases on new video games. For bonus offers and everyday savings on a wide selection of games and accessories, visit our Deals Store . Don\u2019t forget to trade in the games you\u2019ve already finished for Amazon.com gift cards in the Video Games Trade-In Store .", "parent_text": "Movies, Music & Games", "keyword_density": {"games": "4.1", "amazoncom": "1.4", "video games": "4.5", "video": "2.7"}, "department_id": 8},
{"department_text": "Movies, Music & Games", "level": 1, "url": "http://www.amazon.com/Entertainment-Collectibles/b/ref=sd_allcat_entcol/186-5151927-0681541?ie=UTF8&node=5088769011", "text": "Entertainment Collectibles", "description_title": "Entertainment Collectibles at Amazon.com", "keyword_count": {"collectibles": 9, "entertainment collectibles": 4}, "description_wc": 167, "description_text": "Welcome to the Entertainment Collectibles Store featuring music, movie, TV, and theater memorabilia, collectibles, and autographs from the past and present. The Entertainment Collectibles store covers many genres with Amazon Marketplace sellers offering a unique selection of autographed items and collectible memorabilia. If you are looking to build your collection of music memorabilia, movie collectibles, TV collectibles, theater memorabilia, or want to find a unique gift for an avid collector, then the new Entertainment Collectibles Store has the unique selection that you are looking for. The store focuses on authenticated collectibles and memorabilia, such as autographs authenticated by PSA/DNA, R.E.A.L. and Autograph Pros. Whichever artists, actors, actresses, are your favorite, you should be able to find them in our giant selection of autographed photos, posters, prints, trading cards, musical instruments, props, wardrobe, and other memorabilia, and collectibles. The store will continue to grow, so whether you are adding to your collection or buying something as a gift, find it at the new Amazon Entertainment Collectibles Store.", "parent_text": "Movies, Music & Games", "keyword_density": {"collectibles": "5.4", "entertainment collectibles": "4.8"}, "department_id": 8},
{"department_text": "Electronics & Computers", "level": 1, "url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/186-5151927-0681541?ie=UTF8&node=667846011", "text": "Home Audio & Theater", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Home Audio and Home Theater", "keyword_count": {"home audio": 3, "home theater": 1, "audio": 6, "theater": 6, "home": 12}, "description_wc": 312, "description_text": "Entertaining friends and family can be a lot of work. Whether you are hosting a movie night and want a cinema-quality sound system or just easy listening at home, you will find everything you need right here. At Amazon.com's Home Audio and Theater Store we have an unbeatable selection of home entertainment brands, a list that includes top brands such as Sonos, Polk Audio, Bose, Yamaha, Logitech, Onkyo, Soundmatters International, Eton, Definitive Technology, Pyle, ZVOX, MartinLogan, C. Crane Company, Marantz, Midland Consumer Radio, Audio-Technica, Coby, Crosley Radio, Sony, Samsung, Panasonic, Grace Digital, Bic America, LG, Denon, JBL, Sangean, Infinity, Klipsch, Harman Kardon, Vizio, Pioneer, Energy, Boston Acoustics, Atlantic Technology, RCA, and more. These brands have become trusted over time because of their expertise in a wide variety of home entertainment products. Within this long list of brands, you'll be able to find home entertainment products for all your needs, starting with the essential speakers for any home. Our store carries bookshelf speakers, subwoofers, floorstanding speakers, center channel speakers, ceiling speakers, wireless speakers, soundbars, indoor speakers, outdoor speakers, and a variety of home theater system speaker sets. We also carry a variety of other products that complete your home entertainment system such as receivers, amplifiers, CD players, CD recorders, turntables, and more. If you're building a movie theater in your own home, you'll want to be sure you have the proper components to replicate the theater experience: projectors, surround speaker systems, receivers, and amplifiers. You can also find everything you need to listen on-the-go in our store. We carry boomboxes, portable radios, clock radios, and compact stereos that make it easy to take audio anywhere. Need help finding the right home audio and theater products? Our featured home audio and theater categories make it easy to find the perfect addition to your home entertainment system.", "parent_text": "Electronics & Computers", "keyword_density": {"home audio": "1.9", "home theater": "0.6", "audio": "1.9", "theater": "1.9", "home": "3.8"}, "department_id": 9},
