{"department_text": "Movies, Music & Games", "level": 1, "url": "http://www.amazon.com/musical-instruments-accessories-sound-recording/b/ref=sd_allcat_mi/186-5151927-0681541?ie=UTF8&node=11091801", "text": "Musical Instruments", "description_title": "Amazon.com's Musical Instruments Store", "keyword_count": {"musical instruments store": 2, "instruments": 6, "amazoncom": 3, "musical instruments": 5, "musical": 6, "store": 5}, "description_wc": 277, "description_text": "Welcome to the Musical Instruments Store at Amazon.com. From stage to studio, this is your source for the gear you need to perform your best--whether you\u2019re a beginner or a seasoned musician. Browse our selection of guitars, keyboards, basses, amps, drums, stringed instruments, band & orchestra, DJ gear, and more to get set up with the perfect instrument. Check out the latest recording equipment, from microphones to monitors and audio interfaces to DAW software. Take care of your live sound needs with power amps, speakers, and cables galore. Pick up some pro lighting effects for your next gig. Or how about some fun kids\u2019 musical instruments to get \u2018em started at a young age? Whatever your goal--outfitting a venue, recording a rock & roll masterpiece, DJing parties, learning violin--Amazon has you covered. Check out top deals, gift ideas, best-selling gear, and featured brands such as Fender, Gibson, Line 6, Pearl, M-Audio, Avid, Shure Microphones, Zildjian, Sabian, Peavey, Epiphone, Yamaha, Casio, and hundreds more. Take advantage of Amazon Prime shipping, financing with the Amazon.com Store Card, and other special offers. Browse our special stores, such as the Beginner Store for students and those just starting out, or the Musical Instruments Outlet, featuring huge markdowns on all kinds of gear and equipment. Need accessories for your instrument? No problem\u2014pick up some strings, sticks, reeds, picks, stands, tuners, or anything else you might need from our huge selection. And, as with all things Amazon.com, check out customer reviews of musical instruments to help make your choice. Whatever your musical needs, you\u2019ll find it here in the Musical Instruments Store. Start making some music today!", "parent_text": "Movies, Music & Games", "keyword_density": {"musical instruments store": "2.2", "instruments": "2.2", "amazoncom": "1.1", "musical instruments": "3.6", "musical": "2.2", "store": "1.8"}, "department_id": 8},
