{"department_text": "Movies, Music & Games", "level": 1, "url": "http://www.amazon.com/movies-tv-bluray-bluray3d/b/ref=sd_allcat_blu/186-5151927-0681541?ie=UTF8&node=2901953011", "text": "Blu-ray", "description_title": "More About Blu-ray at Amazon Movies & TV", "keyword_count": {"blu ray": 6, "movies": 4, "amazon": 1, "movies tv": 2}, "description_wc": 111, "description_text": "The Amazon.com Movies & TV Blu-ray Store is your one-stop shop for everything Blu-ray. Browse best sellers, today\u2019s deals, top new and upcoming releases, hit movies, and more. Find titles to take advantage of everything your Blu-ray player offers: high-definition 1080p video, multi-channel surround sound, extra features with Bonus View or online with BD Live, or immersive 3D Blu-ray titles. Take a look at customer Blu-ray reviews of movies, TV shows, documentaries, and other favorites, from the Star Wars series to Avatar. Whether you\u2019re shopping for a gift or are an avid collector, you\u2019ll find the best Blu-ray movies here.", "parent_text": "Movies, Music & Games", "keyword_density": {"blu ray": "10.8", "movies": "3.6", "amazon": "0.9", "movies tv": "3.6"}, "department_id": 8},
