{"department_text": "Movies, Music & Games", "level": 1, "url": "http://www.amazon.com/movies-tv-dvd-bluray/b/ref=sd_allcat_mov/186-5151927-0681541?ie=UTF8&node=2625373011", "text": "Movies & TV", "description_title": "More About Movies & TV at Amazon", "keyword_count": {"tv": 6, "movies": 3, "amazon": 2, "movies tv": 2}, "description_wc": 164, "description_text": "The Amazon Movies & TV Store is your one stop shop for films and TV shows--new releases, best sellers, and today's best deals. With over 500,000 DVDs and Blu-rays to choose from, you\u2019ll find plenty of favorites right here. Search for exactly what you\u2019re looking for or discover new DVD and Blu-ray titles by browsing the Movies & TV Store. You can shop by genre, format, price, and more, or check out editors\u2019 picks for a curated selection. Shop our Deals Store for daily movie and TV deals on DVD and Blu-ray, as well as our TV and Blu-ray Deal of the Week. Finally, if you\u2019re looking for new movies or TV shows, check out the New Release store. When you pre-order select DVDs or Blu-rays at Amazon you get our Pre-order Price Guarantee. Also, you can receive your order on release date with our Release-Date Delivery program (restrictions apply). Happy Shopping!", "parent_text": "Movies, Music & Games", "keyword_density": {"tv": "3.7", "movies": "1.8", "amazon": "1.2", "movies tv": "2.5"}, "department_id": 8},
