{"department_text": "Electronics & Computers", "nr_products": "499", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_8?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A11973981&bbn=667846011&ie=UTF8&qid=1394470708&rnid=667846011", "text": "Turntable Cartridges & Needles", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Turntable Cartridges from Amazon.com", "parent_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/186-5151927-0681541?ie=UTF8&node=667846011", "keyword_count": {"amazoncom": 2, "cartridges": 9, "turntable": 11, "turntable cartridges": 5}, "description_wc": 321, "description_text": "Whether you are getting ready for a stellar DJ performance or a private party at home with friends, you will need a good turntable cartridge to ensure you get the best quality music from your audio equipment. Cartridges hold the needle in a traditional turntable and the magnet in more modern versions, transmitting sound to your speakers. High-quality turntable cartridges may or may not include needles or magnets. The stylus on modern magnet-driven turntables allows for high-quality sound with less concern about scratching potentially rare vinyl albums. Many DJs prefer the sound of more traditional turntable cartridges, and not all cartridges will work on all turntable systems. Amazon.com carries a wide selection of available cartridges from companies such as Audio Technica, Panasonic, and Shure so that you can easily find the right piece for your needs. The tone arm mount is also a major consideration when replacing turntable cartridges. Modern systems typically have a half-inch mount, which has become standard in the industry. Longer mounts may not work with specific turntables, and incorrect cartridges could lead to potential damage. Choosing the right arm mount length can help minimize the risks to your records. Force gauges and other accessories can also help prevent damage from regular turntable use. Modern features have made turntable cartridges far more advanced than earlier versions. Styluses have begun to replace needles, and special guards protect your records from damage. Headshell wires are often easily replaced using only a small screwdriver, allowing you to get the most out of your cartridge and ensure that it lasts for some time with regular maintenance. Many units are designed to work with specific equipment, creating powerful sounds when employed in combination with their sister parts. Amazon.com allows you to shop for turntable cartridges and other musical accessories or instruments from the comfort of your own home. Save both time and money with inexpensive and fast shipping options.", "parent_text": "Home Audio & Theater", "keyword_density": {"amazoncom": "0.6", "cartridges": "2.8", "turntable": "3.4", "turntable cartridges": "3.1"}, "department_id": 9},
