{"department_text": "Electronics & Computers", "nr_products": "54244", "level": 0, "url": "http://www.amazon.com/s/ref=lp_502394_nr_n_13?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A7161091011&bbn=502394&ie=UTF8&qid=1394470708&rnid=502394", "text": "Video Surveillance", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Video Surveillance Cameras from Amazon.com", "parent_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/186-5151927-0681541?ie=UTF8&node=502394", "keyword_count": {"cameras": 7, "amazoncom": 2, "surveillance": 10, "video surveillance cameras from amazoncom": 1, "video": 10, "video surveillance": 7, "video surveillance cameras": 5}, "description_wc": 334, "description_text": "Whether you\u2019re a business owner who wants a camera to protect your retail space or you\u2019re looking for a way to protect your property at home, the video surveillance cameras from Amazon.com can be a great solution. From small and discreet camera systems to smartphone-compatible webcams, we have a wide variety of video surveillance cameras to choose from. CCTV cameras, similar to the ones used professionally in retail stores, hang from the ceiling or the walls for clear visuals and recordings. Weatherproof models are great for outdoor surveillance as well, to add security to dark backyards, secluded alleys, and poorly visualized entrances and exits. Many of our video surveillance systems come with added LED lights and night vision capabilities so you can record clear images, even when it gets dark outside. Many of our video surveillance cameras even feature Wi-Fi and remote-access capabilities so you can watch live video and recordings from a remote location or surveillance hub.. For home use, we also have a great selection of video surveillance cameras to keep a comforting eye on your kids and pets when you're away or out of the room. Video baby monitors are extremely easy to set up and use, and are great for checking on baby without the risk of waking him up. Some baby monitors have up to an 800-foot range, so you never have to be far from your little ones with handheld monitors while tossing the laundry in the dryer, checking emails in the living room, or letting the the cat out. For full home protection, we also offer larger bundles of video surveillance cameras to completely monitor every room in the house. Some bundles come with up to sixteen individual video cameras and a surveillance system that keeps up to 1TB of stored information that you can access with any enabled device, including smartphones, tablets, and network-connected computers. You can find video surveillance equipment for professional and private use at Amazon.com.", "parent_text": "Camera, Photo & Video", "keyword_density": {"cameras": "2.1", "video surveillance cameras from amazoncom": "1.5", "surveillance": "3.0", "amazoncom": "0.6", "video": "3.0", "video surveillance": "4.2", "video surveillance cameras": "4.5"}, "department_id": 9},
