{"department_text": "Electronics & Computers", "nr_products": "6", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1266092011_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A1266092011%2Cn%3A2632816011&bbn=1266092011&ie=UTF8&qid=1394470709&rnid=1266092011", "text": "Installation Services", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "TV Installation from Amazon.com", "parent_url": "http://www.amazon.com/Televisions-Video/b/ref=sd_allcat_tv/186-5151927-0681541?ie=UTF8&node=1266092011", "keyword_count": {"tv": 12, "tv installation": 5, "amazoncom": 2}, "description_wc": 311, "description_text": "Catch all your favorite shows and enjoy the freedom and break from wrestling with your television by connecting with local TV installation providers for quick and hassle-free setup. Whether you\u2019ve got a wall-mounted or on-stand television, Amazon.com wide selection of TV installation services will have your TV set up in no time. From basic to premium services, choose from a variety of options to have your electronics set up and displayed professionally. Including both the expert services and mount itself, all you need to do is provide the TV. With a simple click of the mouse, we will contact professional servicers on your behalf, who will in turn schedule a TV installation appointment with you based on the size and type of your television. Easily filter through services by brands, customer rating, price, and keyword for the best TV installation for your home, budget, and TV. Basic services will mount and install your TV, while more extensive services will take care of concealing wires in the wall or with wire moulding. You can even read service reviews from other customers like you right on the page to see how well they really hold up in real life. We also feature a variety of televisions, accessories, and extras to make your home theater even better. From large flat-screen TVs and sleek Blu-ray players to popular Roku streaming devices, projectors, and powerful speaker systems, it\u2019s easy to enhance any movie, soundtrack, or video game. And if you\u2019re interested in mounting your TV yourself, we offer several wall mounting kits and tools to keep you effective, empowered, and safe when you want to enjoy the satisfaction of a little DIY. Get your new TV up on the wall sooner with TV installation services from Amazon.com and you\u2019ll be sure to catch all your favorite shows.", "parent_text": "TV & Video", "keyword_density": {"tv": "3.9", "tv installation": "3.2", "amazoncom": "0.6"}, "department_id": 9},
