{"department_text": "Electronics & Computers", "nr_products": "6765", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1266092011_nr_n_11?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A1266092011%2Cn%3A13447451&bbn=1266092011&ie=UTF8&qid=1394470709&rnid=1266092011", "text": "Streaming Media Players", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Media Players From Amazon.com", "parent_url": "http://www.amazon.com/Televisions-Video/b/ref=sd_allcat_tv/186-5151927-0681541?ie=UTF8&node=1266092011", "keyword_count": {"media": 12, "amazoncom": 1, "players": 7, "media players": 6}, "description_wc": 319, "description_text": "Whether you're looking to forego cable or complement your current home entertainment center, you'll find plenty of media players for all of your streaming and Internet needs. Perfect for the forward-thinking household, these media players will stream anything from movies and television shows to sporting events and music. You'll find several of the best media players from companies like Apple, Roku, and WD-TV. Each of these devices are made for streaming music, along with streaming TV, movies, and even Internet connectivity. You can attach the media players to your Netflix, Amazon Prime, or Pandora account and play your favorites from your TV. It's a fantastic way to have a comprehensive media collection at your fingerprints. Each media player includes a remote control so you can scroll through the menu with ease. The user-friendly devices can be integrated with your home entertainment system, so you can switch between cable and your media player with a few clicks from your remote control. Some devices even have a jack, so you can listen to your music or movie with your favorite pair of headphones. With the mix of audio and visual entertainment, a media player will give your home entertainment system a device for just about everything. Some media players have a USB port so you can transfer files from your computer to watch or listen to on your television. For the tech-savvy household, media players are a way to consolidate your devices while adding to your library of shows to watch and music to listen to. Whichever media player you're looking for, Amazon.com will have one shipped to you in a matter of days. Find the right one for your budget, space, and needs and you'll be ready to expand your media library with a single device. Stream movies, music or television shows to your TV with one of these players.", "parent_text": "TV & Video", "keyword_density": {"media": "3.8", "amazoncom": "0.3", "media players": "3.8", "players": "2.2"}, "department_id": 9},
