{"department_text": "Electronics & Computers", "nr_products": "919", "level": 0, "url": "http://www.amazon.com/s/ref=lp_1266092011_nr_n_6?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A1266092011%2Cn%3A281056&bbn=1266092011&ie=UTF8&qid=1394470709&rnid=1266092011", "text": "Home Theater Systems", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Home Theater from Amazon.com", "parent_url": "http://www.amazon.com/Televisions-Video/b/ref=sd_allcat_tv/186-5151927-0681541?ie=UTF8&node=1266092011", "keyword_count": {"home": 11, "amazoncom": 2, "theater": 10, "home theater": 9}, "description_wc": 314, "description_text": "Home theater systems allow movie lovers to recreate the movie theater experience at home. Instead of standing in long lines to buy tickets, you can watch the latest films and television shows from the comfort of your living room. Whether you need a system for a small apartment or looking to outfit a large entertainment room, you'll find the best home theater system for you at Amazon.com. When putting together a home theater system, you want to use the very best components available. We have home theater speakers and other home entertainment accessories made by the top companies in the industry such as Sony, Samsung, Panasonic, and LG. Get complete systems that include a television, surround sound speakers, remote controls, and iPod or iPhone dock. If you already have a system, we offer a good selection of individual parts that allow you to buy only what you need as well as tools and supplies to help you maintain your system. The products you will find in our online store have the features you want in home theater systems such as HDMI ports, powerful wattage (from 50w to 1kW systems), multiple channels, Internet or satellite radio, and Smart TVs. Many of these home theater systems are Energy Star certified, so you save money on your energy bills. We even have wireless systems that make setting up a true surround sound experience a breeze. Whether you are buying home theater systems for yourself or as a gift to someone else, you'll find the equipment you want made by brands you know, love, and trust. No matter your budget, there are home theater systems available in the price range you're looking for. Fast shipping means your purchase will arrive at your front door right on time. For the best value and selection, choose Amazon.com as the place to shop for home theater systems.", "parent_text": "TV & Video", "keyword_density": {"home": "3.5", "amazoncom": "0.6", "theater": "3.2", "home theater": "5.8"}, "department_id": 9},
