{"department_text": "Electronics & Computers", "nr_products": "15769", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_1?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A14210751&bbn=11846801&ie=UTF8&qid=1394470708&rnid=11846801", "text": "PlayStation 3", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "PlayStation 3 from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=468642", "keyword_count": {"amazoncom": 2, "playstation 3": 8, "3": 11}, "description_wc": 342, "description_text": "The Sony PlayStation 3 is one of the most advanced gaming consoles ever produced. Cutting edge 3D graphics, 5.1 surround digital audio, fully integrated wireless networking, and a dozen other features make it a popular choice among gamers. The PlayStation 3 can do more than just play video games, too. With a Blu-Ray player and hard disk drives up to 500GB, this console is a complete home entertainment unit, capable of playing HD movies, streaming media content from your home computer, and even browsing the internet. At Amazon.com, we offer a complete line of PlayStation 3 consoles, games, and accessories to satisfy gamers, movie watchers, and media streamers alike. You\u2019ll find bestselling PlayStation 3 classics, new releases, and hard to find titles from popular developers like AcTiVision, Ubisoft, and Square Enix across all genres, from FPS to RPGs. To find PlayStation 3 games that you\u2019re interested in, you can use our fast and easy product filters. Choose the developers, genres, ESRB ratings, and release dates you want to browse, and we\u2019ll automatically create a list of games that meet your criteria. If you\u2019re looking to pick up accessories and add-ons for your PS3, you can browse our selection of PlayStation 3 controllers, keyboards, remotes, and more. The original Sony Dualshock controller is a time tested and well-loved peripheral. You\u2019ll find Dualshock and Sixaxis controllers in a wide variety of colors, including brilliant white, satin reds and blues, and even metallic silver and gold. If you\u2019re shopping for your first PlayStation 3, you\u2019ll find a wide selection of consoles to choose from, including Slim models with hard drive space ranging from 160 to 500GB. Many new games are downloadable, so larger hard drives are a must-have for avid gamers. The Sony PlayStation 3 is more than a simple gaming console. The PS3 is an all-in-one entertainment hub for games, movies, and more. Amazon.com carries the consoles, games, and accessories you need to enjoy one of the most popular gaming consoles.", "parent_text": "Video Games", "keyword_density": {"amazoncom": "0.6", "playstation 3": "4.7", "3": "3.2"}, "department_id": 9},
