{"department_text": "Electronics & Computers", "nr_products": "919", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_3?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A281056&bbn=667846011&ie=UTF8&qid=1394470708&rnid=667846011", "text": "Home Theater Systems", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Home Theater from Amazon.com", "parent_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/186-5151927-0681541?ie=UTF8&node=667846011", "keyword_count": {"home": 11, "amazoncom": 2, "theater": 10, "home theater": 9}, "description_wc": 314, "description_text": "Home theater systems allow movie lovers to recreate the movie theater experience at home. Instead of standing in long lines to buy tickets, you can watch the latest films and television shows from the comfort of your living room. Whether you need a system for a small apartment or looking to outfit a large entertainment room, you'll find the best home theater system for you at Amazon.com. When putting together a home theater system, you want to use the very best components available. We have home theater speakers and other home entertainment accessories made by the top companies in the industry such as Sony, Samsung, Panasonic, and LG. Get complete systems that include a television, surround sound speakers, remote controls, and iPod or iPhone dock. If you already have a system, we offer a good selection of individual parts that allow you to buy only what you need as well as tools and supplies to help you maintain your system. The products you will find in our online store have the features you want in home theater systems such as HDMI ports, powerful wattage (from 50w to 1kW systems), multiple channels, Internet or satellite radio, and Smart TVs. Many of these home theater systems are Energy Star certified, so you save money on your energy bills. We even have wireless systems that make setting up a true surround sound experience a breeze. Whether you are buying home theater systems for yourself or as a gift to someone else, you'll find the equipment you want made by brands you know, love, and trust. No matter your budget, there are home theater systems available in the price range you're looking for. Fast shipping means your purchase will arrive at your front door right on time. For the best value and selection, choose Amazon.com as the place to shop for home theater systems.", "parent_text": "Home Audio & Theater", "keyword_density": {"home": "3.5", "amazoncom": "0.6", "theater": "3.2", "home theater": "5.8"}, "department_id": 9},
{"department_text": "Electronics & Computers", "nr_products": "346", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_4?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A322215011&bbn=667846011&ie=UTF8&qid=1394470708&rnid=667846011", "text": "Multiroom Digital Music Systems", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Music Streaming from Amazon.com", "parent_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/186-5151927-0681541?ie=UTF8&node=667846011", "keyword_count": {"streaming": 7, "music streaming": 6, "music": 12, "amazoncom": 1}, "description_wc": 322, "description_text": "When you are shopping for a multiroom music system, what music streaming device you choose makes a large impact on the quality of your listening experience. Whether you want a wireless model, Bluetooth capabilities, or a music-streaming player small enough to carry with you, you can use our site's convenient search and filter options to browse through our catalog and find a device that fits your needs and your budget. We have a variety of music streaming players that have built-in Wi-Fi, giving you the freedom to take your music with you wherever there is a wireless Internet connection. We also have a wide selection of Bluetooth-enabled devices, from full stereo systems to compact devices designed for areas with limited space. Whether you are looking for a weather-resistant outdoor speaker system, a video and music streaming box that includes a remote and keyboard, or an all-in-one player with integrated speakers that lets you play different tracks in different rooms of your home, you can browse, search, and select music streaming equipment from top brands like Roku, Apple, Sonos, Netgear, Sling Media, and more. We also offer media streaming devices, including projectors and tuners that feature a variety of convenient functions, including alarms, AM/FM and HD radio capabilities, and LCD displays. If you are looking for equipment that has modern functionality but vintage-appeal, we have options featuring classic finishes designed to mimic the wood construction of old-school music players. Your personality and style should be reflected in your music-streaming player, which gives you all of the modern conveniences of digital music. Whether you want a device for personal listening or want to play music through your entire house, you can shop for the audiophile in your life, all from the comfort of your own home. Amazon.com has what you need to bring music to every area in your home and yard.", "parent_text": "Home Audio & Theater", "keyword_density": {"streaming": "2.2", "music streaming": "3.7", "music": "3.7", "amazoncom": "0.3"}, "department_id": 9},
