{"department_text": "Electronics & Computers", "nr_products": "1806", "level": 0, "url": "http://www.amazon.com/s/ref=lp_667846011_nr_n_5?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A667846011%2Cn%3A172521&bbn=667846011&ie=UTF8&qid=1394470708&rnid=667846011", "text": "Portable DVD Players", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Portable DVD Players from Amazon.com", "parent_url": "http://www.amazon.com/Home-Audio-Electronics/b/ref=sd_allcat_hat/186-5151927-0681541?ie=UTF8&node=667846011", "keyword_count": {"amazoncom": 1, "portable dvd players": 4, "portable dvd": 8}, "description_wc": 322, "description_text": "Whether you travel often for work or are going on a trip for fun, bring a portable DVD player with you to pass the time while you're on a plane or a train. Bring your favorite movies along with you and watch them by yourself or with a friend. These portable DVD players come in a compact size that can fit nicely in your book bag or suitcase. When searching for the best portable DVD player, you'll find devices from Sony, Sylvania, and Phillips that come with screens anywhere from seven to nine inches in size. The best of these portable DVD players feature a high definition screen that'll bring out a high-quality picture from your disc. With your portable DVD player, you can watch you movie on your lap or at a desk. While at home, the player is small enough to fit nicely on your desk or shelf. Some of the devices even have a USB port so you can transfer music or video files onto the player from your computer. You'll also find portable DVD players with a swivel design that lets you move the device's screen to face you. It's great for when you want to view a movie without anyone else seeing what you're watching. There's also a jack on the side so you can plug in your headphones and view your movie or TV show without bothering those around you. Some portable DVD players even have audio options, allowing you to customize the sound settings on your device. After you've found the right portable DVD player for you, make your order right here on Amazon.com. You'll find plenty of shipping options that'll get your device to your home within a few days. Once you have it, you'll be set to entertain yourself on that long flight or train ride for work or play.", "parent_text": "Home Audio & Theater", "keyword_density": {"amazoncom": "0.3", "portable dvd players": "3.7", "portable dvd": "5.0"}, "department_id": 9},
