{"department_text": "Movies, Music & Games", "nr_products": "2170", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_2?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A6469269011&bbn=11846801&ie=UTF8&qid=1394470708&rnid=11846801", "text": "Xbox One", "description_title": "Xbox One from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=468642", "keyword_count": {"xbox": 12, "amazoncom": 2, "xbox one": 10, "one": 12}, "description_wc": 356, "description_text": "Microsoft\u2019s Xbox One is the latest offering in the Xbox family of gaming and entertainment consoles. Designed to be an all in one entertainment system, the Xbox One combines cutting edge gaming, media streaming, internet connectivity, and television integration. At Amazon.com, we offer a variety of Xbox One consoles, games, and accessories. Featuring an 8 core AMD processor with a 12 core GPU, 8 gb of RAM, and 500 gb of storage space, the Xbox One is a formidable machine. Fully integrated wireless internet makes it easier than ever to connect to Xbox Live, and play games online with your friends all over the world. The Xbox One can also connect with your television service, and offers an enhanced programming guide, as well as real time updates to fantasy sports leagues, right as the action is happening. The initial offering of Xbox One games includes franchise favorites, as well as a selection of new properties sure to get gamers excited. The latest iteration of the Call of Duty series promises an even more realistic and detailed warfare experience, with improvements to the graphics, gameplay, and online capabilities millions of gamers love. Sports fans are eagerly anticipating next generation releases from the Madden and NBA2K series. You can burn rubber and shave seconds off your lap time with Forza 5, which puts you behind the wheel of exotic super cars from around the world, and challenges you to stay cool while you push the limits of your vehicle on one of dozens of famous racetracks around the world. Other highly anticipated releases include Titan Fall, The Division, Ryse, Destiny, Watch Dogs, Final Fantasy XV, andand Dead Island 3, which promises even more zombie smashing mayhem. We also offer a full range of Xbox One accessories, including controllers, headsets, and protective skins. Shopping online at Amazon.com makes it easy to find the Xbox One accessories you need, and our selection is growing all the time. The Xbox One sets a new standard in home entertainment consoles. From cutting edge gaming, to steaming movies and music, the Xbox One is the only piece of hardware you\u2019ll need.", "parent_text": "Video Games", "keyword_density": {"one": "3.4", "amazoncom": "0.6", "xbox one": "5.6", "xbox": "3.4"}, "department_id": 8},
