{"department_text": "Movies, Music & Games", "nr_products": "14674", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_4?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A14218901&bbn=11846801&ie=UTF8&qid=1394470708&rnid=11846801", "text": "Wii", "description_title": "Wii Games from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=468642", "keyword_count": {"amazoncom": 3, "wii games": 8, "wii": 15}, "description_wc": 273, "description_text": "New Wii games for everyone\u2019s favorite white console guarantee a good time for players of all levels of experience. When both newbies and experts find promise in the Wii\u2019s unique platform and the vast selection of innovative Wii games, you know you\u2019ve stumbled onto a gem among systems. Whether you\u2019re in the market for new Wii games or the console itself, Amazon.com offers all the gadgets, gizmos, and info you need to get moving with your own Wii Remote. While the Wii\u2019s bright white design may have first caught the world\u2019s attention, you\u2019ll also find striking black and red versions via the Console Guide . Amazon.com carries a variety of Wii bundles that consolidate your shopping list into one convenient package, so you can spend less time online and more time playing Wii games. Looking for your very own home fitness system? Wii Fitness Accessories include Wii Fit wrist straps, belts, boxing gloves, push-up bars, and aerobic steps and sporty Wii games to go with them. These products will get your heart pumping and your mind racing by turning your Wii into a virtual fitness center. Take an hour or two from your day to delve into exhilarating Wii games. Groove out with Just Dance 4 , follow the hobbits in LEGO Lord of the Rings, and revisit your favorite plumbers in Super Mario Bros. We pride ourselves in bringing the newest Wii games and hardware to your computer and doorstep as quickly as possible. More than just a gaming system, the transformative Wii games and consoles at Amazon.com give new definition to having fun.", "parent_text": "Video Games", "keyword_density": {"amazoncom": "1.1", "wii games": "5.9", "wii": "5.5"}, "department_id": 8},
