{"department_text": "Movies, Music & Games", "nr_products": "22253", "level": 0, "url": "http://www.amazon.com/s/ref=lp_468642_nr_n_3?rh=n%3A468642%2Cn%3A%2111846801%2Cn%3A14220161&bbn=11846801&ie=UTF8&qid=1394470708&rnid=11846801", "text": "Xbox 360", "description_title": "Xbox 360 Games from Amazon.com", "parent_url": "http://www.amazon.com/computer-video-games-hardware-accessories/b/ref=sd_allcat_cvg/186-5151927-0681541?ie=UTF8&node=468642", "keyword_count": {"xbox 360": 11, "amazoncom": 2, "xbox 360 games": 9, "xbox": 12}, "description_wc": 288, "description_text": "Test your mettle against close friends and fierce rivals with Microsoft\u2019s remarkable advanced gaming platform and Xbox 360 games. Amazon.com is your online source for the best deals on Xbox 360 games and accessories, along with Xbox LIVE time and Microsoft Points that will keep you at the front lines of gaming and ahead of the competition. Take the first leap toward building your system at the Consoles Store before you build your collection of Xbox 360 games. You\u2019ll find dozens of Xbox 360 consoles sold individually, bundled with Kinect , in various colors, and equipped with different hard drive capacities, so you can match your gaming platform to your personality and Xbox 360 games. If you\u2019re looking to enhance your existing console and how you interact with your Xbox 360 games, peek in the Accessories Store, where you\u2019ll find everything you need to jumpstart the action. Accessory kits, headsets, controllers, fitness accessories, skins, faceplates, batteries, and purchasable networking points allow you to customize your console for a whole new level of gaming possibilities. These products will make the Xbox 360 your go-to device for gaming and media. We pride ourselves on delivering the best selection of Xbox 360 games, along with an expansive array of consoles and accessories. Find action, flying, racing, strategy, and adventure Xbox 360 games and browse Xbox 360 games by rating, genre, and release date to share the next must-have release with family, friends, coworkers, and other gamers in your life. With this Microsoft console, you\u2019ll experience the camaraderie of online gaming and exclusive Xbox 360 games you won\u2019t find anywhere else. Compare your progress with like-minded gamers with bundles and accessories from Amazon.com.", "parent_text": "Video Games", "keyword_density": {"xbox 360": "7.7", "xbox": "4.2", "amazoncom": "0.7", "xbox 360 games": "9.4"}, "department_id": 8},
