{"department_text": "Electronics & Computers", "nr_products": "59787", "level": 0, "url": "http://www.amazon.com/s/ref=lp_502394_nr_n_7?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A7161086011&bbn=502394&ie=UTF8&qid=1394470708&rnid=502394", "text": "Lighting & Studio", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Photo Studio Lighting from Amazon.com", "parent_url": "http://www.amazon.com/Camera-Photo-Film-Canon-Sony/b/ref=sd_allcat_p/186-5151927-0681541?ie=UTF8&node=502394", "keyword_count": {"photo studio lighting": 5, "photo": 13, "photo studio": 6, "amazoncom": 2, "studio": 8, "lighting": 7}, "description_wc": 320, "description_text": "Great photos and portraits aren\u2019t just usually taken on a whim--they take time, effort, and forethought to convey the photographer\u2019s idea. Thinking about the quality of light you want to have in your composition is a great part of the creative process and at Amazon.com, we want to help you find the best photo studio lighting options that will help you bring your vision to life. There\u2019s no definitive rule to how many reflectors, umbrellas, or photo studio lighting accessories you should use--it heavily depends on the type of photo shoot you\u2019re conducting and where. Whatever your vision for the light in your photos, we can help you make sure you have what you need whether you\u2019re shooting indoors or out. From strobe lights, flash tubes, and continuous output lighting, to barn doors, booms, and stands, you\u2019ll quickly learn how to create your own lighting schemes and ideas. You\u2019ll also want to check out our selection of light meters, color calibration charts, and other accessories to complete your photo studio lighting kits. We also carry a wide selection of other photo and video studio equipment that can help give your photography a professional feel and look from more than just photo studio lighting. From studio backdrops, clamps, and gaffers tape, to presentation materials like leather portfolios, digital picture frames, and matte backing, you can find everything you need to turn your study, living room, or den into a working photo studio. Or if you\u2019re more interested in video, we also have teleprompters and video monitors to keep track of all the action. And with free shipping and free returns on eligible items, we make it affordable and convenient to have all your photography equipment, supplies, and accessories right to your door. When you shop for photo studio lighting supplies from Amazon.com, you\u2019ll never be left in the dark again.", "parent_text": "Camera, Photo & Video", "keyword_density": {"photo studio lighting": "4.7", "photo": "4.1", "photo studio": "3.8", "amazoncom": "0.6", "lighting": "2.2", "studio": "2.5"}, "department_id": 9},
