{"department_text": "Electronics & Computers", "nr_products": "36", "level": -1, "url": "http://www.amazon.com/s/ref=lp_281052_nr_n_6?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A281052%2Cn%3A3109925011&bbn=281052&ie=UTF8&qid=1394470727&rnid=281052", "text": "Medium Format Digital Cameras", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Medium Format Digital Cameras from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_502394_nr_n_3?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A281052&bbn=502394&ie=UTF8&qid=1394470708&rnid=502394", "keyword_count": {"medium format digital cameras from amazoncom": 1, "cameras": 13, "amazoncom": 2, "medium format": 9, "digital": 9, "medium format digital cameras": 7}, "description_wc": 305, "description_text": "Medium format photography is widely used and popular around the world, often characterized by cameras with larger film sensors, higher resolution photographs, and the recently popular lomography style. Current medium format digital cameras usually refer to film cameras adapted to digital use, or cameras using sensors larger than a 35mm film frame. When you\u2019re ready to take your photography to the next level or you\u2019re looking for a new way of shooting, our medium format digital cameras may be just the thing to get your creative juices flowing. With a larger imaging sensor and a higher image quality, medium format digital cameras often produce sharper, more detailed, and more complex photographs. Many photographers have already made the switch to medium format because of what is possible with the higher technology, larger sensors, and larger pixel count. Featuring well-known brands like Pentax, Hasselblad, Mamiya, and Leica, you can find the perfect medium format digital cameras for you needs at Amazon.com. Easily browse our selection of medium format digital cameras, or filter by megapixels, display size, viewfinder type, and other attributes to quickly refine your search. We offer a host of choices to choose from that will personalize your camera to your preferences. We also include customer reviews and ratings right on the page so you can read tips, suggestions, and recommendations from other photographers and customers. Our Camera & Photo Store features many types of digital, film, and video cameras, lenses, filters, bags, and other camera gear, equipment, and accessories to fill your toolkit and equip you in your photography practice. From medium format digital cameras and compact systems to basic point-and-shoot cameras and larger DSLR cameras, we carry everything you need to take the perfect picture. See the world in a whole new way with medium format digital cameras from Amazon.com.", "parent_text": "Digital Cameras", "keyword_density": {"medium format digital cameras from amazoncom": "2.0", "cameras": "4.3", "amazoncom": "0.7", "medium format": "5.9", "digital": "3.0", "medium format digital cameras": "9.2"}, "department_id": 9},
