{"department_text": "Electronics & Computers", "nr_products": "4249", "level": -1, "url": "http://www.amazon.com/s/ref=lp_172437_nr_n_9?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A172437%2Cn%3A3345831&bbn=172437&ie=UTF8&qid=1394470728&rnid=172437", "text": "Binocular, Camera & Camcorder Straps", "department_url": "http://www.amazon.com/s/ref=lp_172659_ex_n_1?rh=n%3A172282&bbn=172282&ie=UTF8&qid=1393338741", "description_title": "Camera Straps from Amazon.com", "parent_url": "http://www.amazon.com/s/ref=lp_502394_nr_n_1?rh=n%3A172282%2Cn%3A%21493964%2Cn%3A502394%2Cn%3A172437&bbn=502394&ie=UTF8&qid=1394470708&rnid=502394", "keyword_count": {"camera": 19, "amazoncom": 1, "straps": 11, "camera straps": 7}, "description_wc": 386, "description_text": "No matter whether you have a neat, point-and-shoot camera or a large DSLR, no one ever wants to experience the moment your camera slips out of your hand and you watch helplessly as it falls to the ground in slow motion. Make sure that never happens to your camera! You can protect your photography equipment with the right camera straps that will help keep your camera safe and sound around your neck, wrist, arm, or shoulder. Recommended for hobbyists, professionals, and amateurs alike, the type of camera strap you need heavily depends on the type of camera you own. Larger cameras that can be used with variety of different lenses are better held with wider and thicker neck straps made for heavy-duty. On the other side of the spectrum, slim cameras can be easily held with thinner and lighter wrist straps that you won\u2019t have to think about. We include customer reviews and ratings right on the page so you can see tips, recommendations, and suggestions on how well our camera straps hold up with real use. With a variety of camera straps available from top brands like GoPro, OP/TECH, Cowboy Studio, and Black Rapid, you won\u2019t have to worry about dropping your camera again. Easily find the straps that work for your camera with our product filters that quickly refine your search to your chosen criteria. Filter by price and discount for wallet-friendly and durable choices, or by brands for your trusted and quality favorites. You can also filter by keywords to see our selection of camera straps with adjustable lengths, leather materials, padded cushioning, and other popular attributes you may want. For those looking for hands-free camera straps and holders, we offer a range of head- and body-mounted harnesses and straps that won\u2019t get in the way when you\u2019re sky diving, mountain biking, trekking across the country, or just chasing around the dog. With various models available that attach your camera to your head, wrist, or neck, many of our hands-free camera straps are also waterproof, buoyant, and durable enough for more extreme situations. Stock up on the camera straps, extra memory cards, and other camera accessories you need for a full-day photo shoot or your next family vacation at Amazon.com.", "parent_text": "Bags & Cases", "keyword_density": {"amazoncom": "0.3", "camera": "4.9", "camera straps": "3.6", "straps": "2.8"}, "department_id": 9},
