g wee ones safe in the world of big people. At Amazon.com, you\u2019ll find the items that will work best for your home: if you have a lot of accessible doors, windows, and cabinets, you can use latches to securely close them. Or if you have pets that aren't ready to be socialized with young members of the family, baby gates with pet doors double their function around the house. In the yard, at home, or on-the-go, you can keep the ouchies and boo-boos to a minimum. With baby safety supplies from Amazon.com, your home can be a safe space to live, learn, and play.", "parent_text": "Baby-2", "keyword_density": {"baby": "3.5", "amazoncom": "0.9", "safety": "2.0", "baby safety": "2.9"}, "department_id": 7},
