{"department_text": "Books & Audible", "nr_products": "394", "level": 0, "url": "http://www.amazon.com/s/ref=lp_599858_nr_n_21?rh=n%3A599858%2Cn%3A%21599872%2Cn%3A602350&bbn=599872&ie=UTF8&qid=1394470730&rnid=599872", "text": "Literary Magazines & Journals", "description_title": "Literary Magazines from Amazon.com", "parent_url": "http://www.amazon.com/magazines/b/ref=sd_allcat_magazines/186-5151927-0681541?ie=UTF8&node=599858", "keyword_count": {"literary magazines from amazoncom": 1, "amazoncom": 2, "magazines": 8, "literary magazines": 7}, "description_wc": 356, "description_text": "If your love for words is like the red, red rose that\u2019s newly sprung in June, literary magazines from Amazon.com could be a welcome boon. Discover some of the most engaging and enriching new poetry, fiction, and non-fiction that\u2019s available in some of our journals and publications. We have a wide variety of fantastic literary magazines for you to choose from. Choose by genre to find stories, poetry, and essays in the subject of your choice. Literature and fiction magazines such as the New Yorker , Missouri Review , Bookmarks , and more will keep your mind stimulated with some of the most intricate stories, well-crafted poetry, and cutting-edge non-fiction. Literary magazines focused on mystery and suspense, including The Strand and Ellery Queen\u2019s Mystery Magazine , will leave you nervous and thrilled to turn the next page. Plus, our science fiction and fantasy selections, like Analog , Asimov\u2019s , and Fantasy & Science Fiction , deliver a sense of wonder second to none. Fans of poetry will find many of our literary magazines dedicated to one of the most demanding forms of writing. Discover inspiring lines and mind-bending metaphors in some of the top poetry publications, including Poetry , American Poetry Review , and Spoon River Poetry Review . By flipping through the pages, reading short, sharp poems, you could be discovering the next Emily Dickinson, Dylan Thomas, or William Carlos Williams. Literary magazines like Poets & Writers are also great resources for budding poets who want news on upcoming writer\u2019s retreats, tips from writing professionals, and information on where to publish your own verse. Many of our literary magazines also tackle some of the biggest issues facing us today. The Atlantic , Harper\u2019s Magazine , Believer , and others include articles, stories and poetry about controversial issues and heated subject matter. It\u2019s a great way to read about what struggles the country is going through from some of the most sharp-tongued journalists and storytellers out there. You can find enough literary magazines to feed your craving for well-written stories and poetry at Amazon.com.", "parent_text": "Magazines", "keyword_density": {"literary magazines from amazoncom": "1.2", "amazoncom": "0.6", "magazines": "2.3", "literary magazines": "4.1"}, "department_id": 7},
