{"department_text": "Books & Audible", "nr_products": "64", "level": 0, "url": "http://www.amazon.com/s/ref=lp_599858_nr_n_6?rh=n%3A599858%2Cn%3A%21599872%2Cn%3A602324&bbn=599872&ie=UTF8&qid=1394470730&rnid=599872", "text": "Computers & Internet", "description_title": "Technology Magazines from Amazon.com", "parent_url": "http://www.amazon.com/magazines/b/ref=sd_allcat_magazines/186-5151927-0681541?ie=UTF8&node=599858", "keyword_count": {"technology": 10, "amazoncom": 2, "magazines": 12, "technology magazines": 8}, "description_wc": 345, "description_text": "Technology magazines are your source for the latest news and information from dozens of high-tech fields like computer science, graphic design, electronics and hardware, and more. From highly technical industry publications to general interest magazines, you\u2019ll find a wide variety of technology magazines well suited to every interest level. At Amazon.com, we offer many technology magazines focused on software development and computer science. From OS specific industry magazines to more conceptual publications covering the latest developments in programming, there\u2019s something to suit every developer and software engineer. You can view and control all your magazines with our subscription manager. We put everything you need in one convenient place, so you can update delivery and billing addresses, renew subscriptions, and check delivery dates for all your subscriptions. You can even add magazines to your subscription manager that you didn\u2019t purchase from Amazon.com, and renew at the same price you initially paid. Most technology magazines are available on a yearly subscription basis, but many are also offered for two-year subscriptions at a discounted price. Technology magazines aren\u2019t limited to just computer science. You\u2019ll also find a variety of publications covering the latest info about digital music production, graphic design, and gaming technology. Bestselling favorites include Wired , Popular Mechanics , and MAKE: Magazine . These technology magazines offer news and information from around the world, detail technological achievements of all kinds, and even provide project ideas for technologically inclined readers. No matter how involved you are in the tech industry, there\u2019s a magazine that can help you learn more about the ever-changing word of technology, science, computers, and engineering. Technology magazines make great gifts for inquisitive friends and family. Simply add your chosen recipient\u2019s address to the delivery field, and they\u2019ll start receiving new issues right away. You can even send a personalized e-mail or printed note to let them know you\u2019re thinking of them. Technology magazines cover the world of cutting-edge science, from astronomy to nano-scale engineering, and everything in-between.", "parent_text": "Magazines", "keyword_density": {"magazines": "3.5", "amazoncom": "0.6", "technology": "2.9", "technology magazines": "4.7"}, "department_id": 7},
